        "Immediately we do exile him hence:<br/>I have an interest in your hate&#x27;s proceeding,<br/>My blood for your rude brawls doth lie a-bleeding;<br/>But I&#x27;ll amerce you with so strong a fine<br/>That you shall all repent the loss of mine.<br/>I will be deaf to pleading and excuses;<br/>Nor tears nor prayers shall purchase out abuses;<br/>Therefore use none; let Romeo hence in haste,<br/>Else, when he&#x27;s found, that hour is his last.<br/>Bear hence this body and attend our will:",
        "Seem&#x27;d to die too; yea, at that very moment,<br/>Consideration like an angel came,<br/>And whipp&#x27;d the offending Adam out of him,<br/>Leaving his body as a paradise,<br/>To envelop and contain celestial spirits.<br/>Never was such a sudden scholar made;<br/>Never came reformation in a flood,<br/>With such a heady currance, scouring faults;<br/>Nor never Hydra-headed wilfulness<br/>So soon did lose his seat and all at once",
        "I went to her in white, and cried, &#x27;mum,&#x27; and she cried &#x27;budget,&#x27; as Anne and I had appointed; and yet it was not Anne, but a postmaster&#x27;s boy.<br/><br/>Jeshu! Master Slender, cannot you see put marry poys?<br/><br/>O I am vexed at heart: what shall I do?<br/><br/>Good George, be not angry: I knew of your purpose; turned my daughter into green; and, indeed, she is now with the doctor at the deanery, and there married.<br/><br/>Vere is Mistress Page? By gar, I am cozened: I ha&#x27; married un gar on, a boy; un paysan, by gar, a boy; it is not Anne Page: by gar, I am cozened.",
        "Is&#x27;t possible that on so little acquaintance you should like her? that, but seeing, you should love her? and, loving, woo? and, wooing, she should grant? and will you persever to enjoy her?<br/><br/>Neither call the giddiness of it in question, the poverty of her, the small acquaintance, my sudden wooing, nor her sudden consenting; but say with me, I love Aliena; say with her, that she loves me; consent with both, that we may enjoy each other: it shall be to your good; for my father&#x27;s house and all the revenue that was old Sir Rowland&#x27;s will I estate upon you, and here live and die a shepherd.",
        "Nay, this shall not hedge us out: we&#x27;ll hear you sing, certainly.<br/><br/>Well, sweet queen, you are pleasant with me. But, marry, thus, my lord. My dear lord and most esteemed friend, your brother Troilus<br/><br/>My Lord Pandarus; honey-sweet lord,<br/><br/>Go to, sweet queen, go to: commends himself most affectionately to you.<br/><br/>You shall not bob us out of our melody: if you do, our melancholy upon your head!",
