        "Enclosed were they with their enemies.<br/>A base Walloon, to win the Dauphin&#x27;s grace,<br/>Thrust Talbot with a spear into the back;<br/>Whom all France, with their chief assembled strength,<br/>Durst not presume to look once in the face.<br/><br/>Is Talbot slain? then I will slay myself,<br/>For living idly here in pomp and ease<br/>Whilst such a worthy leader, wanting aid,<br/>Unto his dastard foemen is betray&#x27;d.",
        "And this the banquet she shall surfeit on;<br/>For worse than Philomel you us&#x27;d my daughter,<br/>And worse than Procne I will be reveng&#x27;d.<br/>And now prepare your throats. Lavinia, come.<br/><br/>Receive the blood: and when that they are dead,<br/>Let me go grind their bones to powder small,<br/>And with this hateful liquor temper it;<br/>And in that paste let their vile heads be bak&#x27;d.<br/>Come, come, be every one officious",
        "But with my heart the other eye doth see.<br/>Ah! poor our sex; this fault in us I find,<br/>The error of our eye directs our mind.<br/>What error leads must err. O! then conclude<br/>Minds sway&#x27;d by eyes are full of turpitude.<br/><br/>A proof of strength she could not publish more,<br/>Unless she said, &#x27;My mind is now turn&#x27;d whore.&#x27;<br/><br/>All&#x27;s done, my lord.",
        "Is as a meeting of the petty gods,<br/>And you the queen on&#x27;t.<br/><br/>Sir, my gracious lord,<br/>To chide at your extremes it not becomes me:<br/>O! pardon, that I name them. Your high self,<br/>The gracious mark o&#x27; the land, you have obscur&#x27;d<br/>With a swain&#x27;s wearing, and me, poor lowly maid,<br/>Most goddess-like prank&#x27;d up. But that our feasts<br/>In every mess have folly, and the feeders",
        "When there is such disorder in my wit.<br/>O Lord! my boy, my Arthur, my fair son!<br/>My life, my joy, my food, my all the world!<br/>My widow-comfort, and my sorrows&#x27; cure!<br/><br/>I fear some outrage, and I&#x27;ll follow her.<br/><br/>There&#x27;s nothing in this world can make me joy:<br/>Life is as tedious as a twice-told tale,<br/>Vexing the dull ear of a drowsy man;",
        "So let the Turk of Cyprus us beguile;<br/>We lose it not so long as we can smile.<br/>He bears the sentence well that nothing bears<br/>But the free comfort which from thence he hears;<br/>But he bears both the sentence and the sorrow<br/>That, to pay grief, must of poor patience borrow.<br/>These sentences, to sugar, or to gall,<br/>Being strong on both sides, are equivocal:<br/>But words are words; I never yet did hear",
        "Since therein she doth evitate and shun<br/>A thousand irreligious cursed hours,<br/>Which forced marriage would have brought upon her.<br/><br/>Stand not amaz&#x27;d: here is no remedy:<br/>In love the heavens themselves do guide the state:<br/>Money buys lands, and wives are sold by fate.<br/><br/>I am glad, though you have ta&#x27;en a special stand to strike at me, that your arrow hath glanced.<br/>",
        "And down goes all before them. Still be kind,<br/>And eke out our performance with your mind.<br/><br/>Once more unto the breach, dear friends, once more;<br/>Or close the wall up with our English dead!<br/>In peace there&#x27;s nothing so becomes a man<br/>As modest stillness and humility:<br/>But when the blast of war blows in our ears,<br/>Then imitate the action of the tiger;<br/>Stiffen the sinews, summon up the blood,",
        "To the sea-monster: I stand for sacrifice;<br/>The rest aloof are the Dardanian wives,<br/>With bleared visages, come forth to view<br/>The issue of the exploit. Go, Hercules!<br/>Live thou, I live: with much, much more dismay<br/>I view the fight than thou that mak&#x27;st the fray.<br/><br/>Tell me where is fancy bred,<br/>Or in the heart or in the head?<br/>How begot, how nourished?",
        "What hast thou done? thou hast mistaken quite,<br/>And laid the love-juice on some true-love&#x27;s sight:<br/>Of thy misprision must perforce ensue<br/>Some true-love turn&#x27;d, and not a false turn&#x27;d true.<br/><br/>Then fate o&#x27;er-rules, that, one man holding troth,<br/>A million fail, confounding oath on oath.<br/><br/>About the wood go swifter than the wind,",
        "Item, She will often praise her liquor.<br/><br/>If her liquor be good, she shall: if she will not, I will; for good things should be praised.<br/><br/>Item, She is too liberal.<br/><br/>Of her tongue she cannot, for that&#x27;s writ down she is slow of: of her purse she shall not, for that I&#x27;ll keep shut: now, of another thing she may, and that cannot I help. Well, proceed.<br/><br/>Item, She hath more hair than wit, and more faults than hairs, and more wealth than faults.<br/>",
        "For interim to our studies shall relate<br/>In high-born words the worth of many a knight<br/>From tawny Spain lost in the world&#x27;s debate.<br/>How you delight, my lords, I know not, I;<br/>But, I protest, I love to hear him lie,<br/>And I will use him for my minstrelsy.<br/><br/>Armado is a most illustrious wight,<br/>A man of fire-new words, fashion&#x27;s own knight.<br/>",
        "Now Ph thon hath tumbled from his car,<br/>And made an evening at the noontide prick.<br/><br/>My ashes, as the ph nix, may bring forth<br/>A bird that will revenge upon you all;<br/>And in that hope I throw mine eyes to heaven,<br/>Scorning whate&#x27;er you can afflict me with.<br/>Why come you not? what! multitudes, and fear?<br/><br/>So cowards fight when they can fly no further;",
        "But my lads, my lads, to-morrow morning, by four o&#x27;clock, early at Gadshill! There are pilgrims going to Canterbury with rich offerings, and traders riding to London with fat purses: I have vizards for you all; you have horses for yourselves. Gadshill lies to night in Rochester; I have bespoke supper to-morrow night in Eastcheap: we may do it as secure as sleep. If you will go I will stuff your purses full of crowns; if you will not, tarry at home and be hanged.<br/><br/>Hear ye, Yedward: if I tarry at home and go not, I&#x27;ll hang you for going.",
        "&#x27;Fair,&#x27; I give you back again; and &#x27;welcome&#x27; I have not yet: the roof of this court is too high to be yours, and welcome to the wide fields too base to be mine.<br/><br/>You shall be welcome, madam, to my court.<br/><br/>I will be welcome, then: conduct me thither.<br/><br/>Hear me, dear lady; I have sworn an oath.<br/><br/>Our Lady help my lord! he&#x27;ll be forsworn.<br/>",
        "I crave their pardons:<br/>For the mutable, rank-scented many, let them<br/>Regard me as I do not flatter, and<br/>Therein behold themselves: I say again,<br/>In soothing them we nourish &#x27;gainst our senate<br/>The cockle of rebellion, insolence, sedition,<br/>Which we ourselves have plough&#x27;d for, sow&#x27;d and scatter&#x27;d,<br/>By mingling them with us, the honour&#x27;d number;<br/>Who lack&#x27;d not virtue, no, nor power, but that<br/>Which they have given to beggars.",
        "That thieves do pass on thieves? &#x27;Tis very pregnant,<br/>The jewel that we find, we stoop and take it<br/>Because we see it; but what we do not see<br/>We tread upon, and never think of it.<br/>You may not so extenuate his offence<br/>For I have had such faults; but rather tell me,<br/>When I, that censure him, do so offend,<br/>Let mine own judgment pattern out my death,<br/>And nothing come in partial. Sir, he must die.<br/>",
        "That &#x27;twixt his mental and his active parts<br/>Kingdom&#x27;d Achilles in commotion rages<br/>And batters down himself: what should I say?<br/>He is so plaguy proud, that the death-tokens of it<br/>Cry &#x27;No recovery.&#x27;<br/><br/>Let Ajax go to him.<br/>Dear lord, go you and meet him in his tent:<br/>&#x27;Tis said he holds you well, and will be led<br/>At your request a little from himself.",
        "Should, notwithstanding that your bond of duty,<br/>As &#x27;twere in love&#x27;s particular, be more<br/>To me, your friend, than any.<br/><br/>I do profess,<br/>That for your highness&#x27; good I ever labour&#x27;d<br/>More than mine own; that am, have, and will be.<br/>Though all the world should crack their duty to you,<br/>And throw it from their soul; though perils did<br/>Abound as thick as thought could make &#x27;em, and",
        "Then he was urg&#x27;d to tell my tale again:<br/>&#x27;Thus saith the duke, thus hath the duke inferr&#x27;d;&#x27;<br/>But nothing spoke in warrant from himself.<br/>When he had done, some followers of mine own,<br/>At lower end of the hall, hurl&#x27;d up their caps,<br/>And some ten voices cried, &#x27;God save King Richard!&#x27;<br/>And thus I took the vantage of those few,<br/>&#x27;Thanks, gentle citizens and friends,&#x27; quoth I;<br/>&#x27;This general applause and cheerful shout<br/>Argues your wisdom and your love to Richard:&#x27;",
        "Go, after, after, cousin Buckingham.<br/>The mayor towards Guildhall hies him in all post:<br/>There, at your meetest vantage of the time,<br/>Infer the bastardy of Edward&#x27;s children:<br/>Tell them how Edward put to death a citizen,<br/>Only for saying he would make his son<br/>Heir to the crown; meaning indeed his house,<br/>Which by the sign thereof was termed so.<br/>Moreover, urge his hateful luxury",
        "A mere satiety of commendations.<br/>If I should pay you for &#x27;t as &#x27;tis extoll&#x27;d,<br/>It would unclew me quite.<br/><br/>My lord, &#x27;tis rated<br/>As those which sell would give: but you well know,<br/>Things of like value, differing in the owners,<br/>Are prized by their masters. Believe &#x27;t, dear lord,<br/>You mend the jewel by the wearing it.<br/>",
        "All of her that is out of door most rich!<br/>If she be furnish&#x27;d with a mind so rare,<br/>She is alone the Arabian bird, and I<br/>Have lost the wager. Boldness be my friend!<br/>Arm me, audacity, from head to foot!<br/>Or, like the Parthian, I shall flying fight;<br/>Rather, directly fly.<br/><br/>He is one of the noblest note, to whose kindnesses I am most infinitely tied. Reflect upon him accordingly, as you value your truest",
        "To dare the vile contagion of the night,<br/>And tempt the rheumy and unpurged air<br/>To add unto his sickness? No, my Brutus;<br/>You have some sick offence within your mind,<br/>Which, by the right and virtue of my place,<br/>I ought to know of; and, upon my knees,<br/>I charm you, by my once-commended beauty,<br/>By all your vows of love, and that great vow<br/>Which did incorporate and make us one,<br/>That you unfold to me, your self, your half,",
        "Speak, cousin; or, if you cannot, stop his mouth with a kiss, and let not him speak neither.<br/><br/>In faith, lady, you have a merry heart.<br/><br/>Yea, my lord; I thank it, poor fool, it keeps on the windy side of care. My cousin tells him in his ear that he is in her heart.<br/><br/>And so she doth, cousin.<br/><br/>Good Lord, for alliance! Thus goes every one to the world but I, and I am sunburnt. I may sit in a corner and cry heigh-ho for a husband!",
        "Thy valiantness was mine, thou suck&#x27;dst it from me,<br/>But owe thy pride thyself.<br/><br/>Pray, be content:<br/>Mother, I am going to the market-place;<br/>Chide me no more. I&#x27;ll mountebank their loves,<br/>Cog their hearts from them, and come home belov&#x27;d<br/>Of all the trades in Rome. Look, I am going:<br/>Commend me to my wife. I&#x27;ll return consul,<br/>Or never trust to what my tongue can do",
        "That going shall be us&#x27;d with feet.<br/><br/>This prophecy Merlin shall make; for I live before his time.<br/><br/>Alack, alack! Edmund, I like not this unnatural dealing. When I desired their leave that I might pity him, they took from me the use of mine own house; charged me, on pain of their perpetual displeasure, neither to speak of him, entreat for him, nor any way sustain him.<br/><br/>Most savage, and unnatural!<br/><br/>Go to; say you nothing. There is division between the dukes, and a worse matter than that. I have received a letter this night; &#x27;tis dangerous to be spoken; I have locked the letter in my closet. These injuries the king now bears will be revenged home; there&#x27;s part of a power already footed; we must incline to the king. I will seek him and privily relieve him; go you and maintain talk with the duke, that my charity be not of him perceived. If he ask for me, I am ill and gone to bed. If I die for it, as no less is threatened me, the king, my old master, must be relieved. There is some strange thing toward, Edmund; pray you, be careful.",
        "Not so hot, good sir;<br/>I come to bring him sleep. &#x27;Tis such as you,<br/>That creep like shadows by him and do sigh<br/>At each his needless heavings, such as you<br/>Nourish the cause of his awaking: I<br/>Do come with words as med&#x27;cinal as true,<br/>Honest as either, to purge him of that humour<br/>That presses him from sleep.<br/><br/>What noise there, ho?",
        "Fat paunches have lean pates, and dainty bits<br/>Make rich the ribs, but bankrupt quite the wits.<br/><br/>My loving lord, Dumaine is mortified:<br/>The grosser manner of these world&#x27;s delights<br/>He throws upon the gross world&#x27;s baser slaves:<br/>To love, to wealth, to pomp, I pine and die;<br/>With all these living in philosophy.<br/><br/>I can but say their protestation over;",
        "What say you, then, to Falconbridge, the young baron of England?<br/><br/>You know I say nothing to him, for he understands not me, nor I him: he hath neither Latin, French, nor Italian; and you will come into the court and swear that I have a poor pennyworth in the English. He is a proper man&#x27;s picture, but, alas! who can converse with a dumb-show? How oddly he is suited! I think he bought his doublet in Italy, his round hose in France, his bonnet in Germany, and his behaviour every where.<br/><br/>What think you of the Scottish lord, his neighbour?",
        "Or, like the Parthian, I shall flying fight;<br/>Rather, directly fly.<br/><br/>He is one of the noblest note, to whose kindnesses I am most infinitely tied. Reflect upon him accordingly, as you value your truest<br/>So far I read aloud;<br/>But even the very middle of my heart<br/>Is warm&#x27;d by the rest, and takes it thankfully.<br/>You are as welcome, worthy sir, as I<br/>Have words to bid you; and shall find it so<br/>In all that I can do.",
        "Whiter than new snow on a raven&#x27;s back.<br/>Come, gentle night; come, loving, black-brow&#x27;d night,<br/>Give me my Romeo: and, when he shall die,<br/>Take him and cut him out in little stars,<br/>And he will make the face of heaven so fine<br/>That all the world will be in love with night,<br/>And pay no worship to the garish sun.<br/>O! I have bought the mansion of a love,<br/>But not possess&#x27;d it, and, though I am sold,<br/>Not yet enjoy&#x27;d. So tedious is this day",
        "I see a cherub that sees them. But, come; for England! Farewell, dear mother.<br/><br/>Thy loving father, Hamlet.<br/><br/>My mother: father and mother is man and wife, man and wife is one flesh, and so, my mother. Come, for England!<br/><br/>Follow him at foot; tempt him with speed aboard:<br/>Delay it not, I&#x27;ll have him hence to-night.<br/>Away! for every thing is seal&#x27;d and done",
        "Avaunt perplexity! What shall we do<br/>If they return in their own shapes to woo?<br/><br/>Good madam, if by me you&#x27;ll be advis&#x27;d,<br/>Let&#x27;s mock them still, as well known as disguis&#x27;d.<br/>Let us complain to them what fools were here,<br/>Disguis&#x27;d like Muscovites, in shapeless gear;<br/>And wonder what they were, and to what end<br/>Their shallow shows and prologue vilely penn&#x27;d,",
        "It is a creature that I teach to fight,<br/>To wind, to stop, to run directly on,<br/>His corporal motion govern&#x27;d by my spirit.<br/>And, in some taste, is Lepidus but so;<br/>He must be taught, and train&#x27;d, and bid go forth;<br/>A barren-spirited fellow; one that feeds<br/>On abject orts, and imitations,<br/>Which, out of use and stal&#x27;d by other men,<br/>Begin his fashion: do not talk of him<br/>But as a property. And now, Octavius,",
        "So may your highness, and yet punish too.<br/><br/>Sir,<br/>You show great mercy, if you give him life<br/>After the taste of much correction.<br/><br/>Alas! your too much love and care of me<br/>Are heavy orisons &#x27;gainst this poor wretch.<br/>If little faults, proceeding on distemper,<br/>Shall not be wink&#x27;d at, how shall we stretch our eye",
        "Who therewith angry, when it next came there,<br/>Took it in snuff: and still he smil&#x27;d and talk&#x27;d;<br/>And as the soldiers bore dead bodies by,<br/>He call&#x27;d them untaught knaves, unmannerly,<br/>To bring a slovenly unhandsome corpse<br/>Betwixt the wind and his nobility.<br/>With many holiday and lady terms<br/>He question&#x27;d me; among the rest, demanded<br/>My prisoners in your majesty&#x27;s behalf.<br/>I then all smarting with my wounds being cold,",
        "Well, you are a rare parrot-teacher.<br/><br/>A bird of my tongue is better than a beast of yours.<br/><br/>I would my horse had the speed of your tongue, and so good a continuer. But keep your way, i&#x27; God&#x27;s name; I have done.<br/><br/>You always end with a jade&#x27;s trick: I know you of old.<br/><br/>This is the sum of all, Leonato: Signior Claudio, and Signior Benedick, my dear friend Leonato hath invited you all. I tell him we shall stay here at the least a month, and he heartily prays some occasion may detain us longer: I dare swear he is no hypocrite, but prays from his heart.",
        "Transformed with their fear, who swore they saw<br/>Men all in fire walk up and down the streets.<br/>And yesterday the bird of night did sit,<br/>Even at noon-day, upon the market-place,<br/>Hooting and shrieking. When these prodigies<br/>Do so conjointly meet, let not men say<br/>&#x27;These are their reasons, they are natural;&#x27;<br/>For, I believe, they are portentous things<br/>Unto the climate that they point upon.<br/>",
        "A right fair mark, fair coz, is soonest hit.<br/><br/>Well, in that hit you miss: she&#x27;ll not be hit<br/>With Cupid&#x27;s arrow; she hath Dian&#x27;s wit;<br/>And, in strong proof of chastity well arm&#x27;d,<br/>From love&#x27;s weak childish bow she lives unharm&#x27;d.<br/>She will not stay the siege of loving terms,<br/>Nor bide the encounter of assailing eyes,<br/>Nor ope her lap to saint-seducing gold:",
        "Have I a tongue to doom my brother&#x27;s death,<br/>And shall that tongue give pardon to a slave?<br/>My brother kill&#x27;d no man, his fault was thought;<br/>And yet his punishment was bitter death.<br/>Who su&#x27;d to me for him? who, in my wrath,<br/>Kneel&#x27;d at my feet, and bade me be advis&#x27;d?<br/>Who spoke of brotherhood? who spoke of love?<br/>Who told me how the poor soul did forsake<br/>The mighty Warwick, and did fight for me?",
        "O thou fond many! with what loud applause<br/>Didst thou beat heaven with blessing Bolingbroke<br/>Before he was what thou wouldst have him be:<br/>And being now trimm&#x27;d in thine own desires,<br/>Thou, beastly feeder, art so full of him<br/>That thou provok&#x27;st thyself to cast him up.<br/>So, so, thou common dog, didst thou disgorge<br/>Thy glutton bosom of the royal Richard,<br/>And now thou wouldst eat thy dead vomit up,<br/>And howl&#x27;st to find it. What trust is in these times?",
        "Gelidus timor occupat artus: &#x27;tis thee I fear.<br/><br/>Thou shalt have cause to fear before I leave thee.<br/>What! are ye daunted now? now will ye stoop?<br/><br/>My gracious lord, entreat him, speak him fair.<br/><br/>Suffolk&#x27;s imperial tongue is stern and rough,<br/>Us&#x27;d to command, untaught to plead for favour.<br/>Far be it we should honour such as these",
        "The perdition of th&#x27; athversary hath been very great, reasonable great: marry, for my part, I think the duke hath lost never a man but one that is like to be executed for robbing a church; one Bardolph, if your majesty know the man: his face is all bubukles, and whelks, and knobs, and flames o&#x27; fire; and his lips blows at his nose, and it is like a coal of fire, sometimes plue and sometimes red; but his nose is executed, and his fire&#x27;s out.<br/><br/>We would have all such offenders so cut off: and we give express charge that in our marches through the country there be nothing compelled from the villages, nothing taken but paid for, none of the French upbraided or abused in disdainful language; for when lenity and cruelty play for a kingdom, the gentler gamester is the soonest winner.",
        "And, but my going, nothing can redeem it.<br/><br/>O! yet for God&#x27;s sake, go not to these wars.<br/>The time was, father, that you broke your word<br/>When you were more endear&#x27;d to it than now;<br/>When your own Percy, when my heart&#x27;s dear Harry,<br/>Threw many a northward look to see his father<br/>Bring up his powers; but he did long in vain.<br/>Who then persuaded you to stay at home?<br/>There were two honours lost, yours and your son&#x27;s:",
        "Or make some sign how I may do thee ease.<br/>Shall thy good uncle, and thy brother Lucius,<br/>And thou, and I, sit round about some fountain,<br/>Looking all downwards, to behold our cheeks<br/>How they are stain&#x27;d, like meadows yet not dry,<br/>With miry alime left on them by a flood?<br/>And in the fountain shall we gaze so long<br/>Till the fresh taste be taken from that clearness,<br/>And made a brine-pit with our bitter tears?<br/>Or shall we cut away our hands, like thine?",
        "To their vile murders: rousted in wrath and fire,<br/>And thus o&#x27;er-sized with coagulate gore,<br/>With eyes like carbuncles, the hellish Pyrrhus<br/>Old grandsire Priam seeks.<br/>So proceed you.<br/><br/>&#x27;Fore God, my lord, well spoken; with good accent and good discretion.<br/><br/>Anon, he finds him<br/>Striking too short at Greeks; his antique sword,",
        "Slain by his servant, going to put out<br/>The other eye of Gloucester.<br/><br/>Gloucester&#x27;s eyes!<br/><br/>A servant that he bred, thrill&#x27;d with remorse,<br/>Oppos&#x27;d against the act, bending his sword<br/>To his great master; who, thereat enrag&#x27;d,<br/>Flew on him, and amongst them fell&#x27;d him dead;<br/>But not without that harmful stroke, which since",
        "Adieu, good queen; I must attend on C sar.<br/><br/>Farewell, and thanks.<br/><br/>Now, Iras, what think&#x27;st thou?<br/>Thou, an Egyptian puppet, shall be shown<br/>In Rome, as well as I; mechanic slaves<br/>With greasy aprons, rules and hammers, shall<br/>Uplift us to the view; in their thick breaths,<br/>Rank of gross diet, shall we be enclouded,",
        "Of thousands that had struck anointed kings,<br/>And flourish&#x27;d after, I&#x27;d not do&#x27;t; but since<br/>Nor brass nor stone nor parchment bears not one,<br/>Let villany itself forswear&#x27;t. I must<br/>Forsake the court: to do&#x27;t, or no, is certain<br/>To me a break-neck. Happy star reign now!<br/>Here comes Bohemia.<br/><br/>This is strange: methinks<br/>My favour here begins to warp. Not speak?",
        "And stole into the covert of the wood:<br/>I, measuring his affections by my own,<br/>That most are busied when they&#x27;re most alone,<br/>Pursu&#x27;d my humour not pursuing his,<br/>And gladly shunn&#x27;d who gladly fled from me.<br/><br/>Many a morning hath he there been seen,<br/>With tears augmenting the fresh morning&#x27;s dew,<br/>Adding to clouds more clouds with his deep sighs:<br/>But all so soon as the all-cheering sun",
        "Hold, Wart, traverse; thus, thus, thus.<br/><br/>Come, manage me your caliver. So: very well: go to: very good: exceeding good. O, give me always a little, lean, old, chopp&#x27;d, bald shot. Well said, i&#x27; faith, Wart; thou&#x27;rt a good scab: hold, there&#x27;s a tester for thee.<br/><br/>He is not his craft&#x27;s master, he doth not do it right. I remember at Mile-end Green, when I lay at Clement&#x27;s Inn,I was then Sir Dagonet in Arthur&#x27;s show,there was a little quiver fellow, and a&#x27; would manage you his piece thus: and a&#x27; would about and about, and come you in, and come you in; &#x27;rah, tah, tah,&#x27; would a&#x27; say; &#x27;bounce,&#x27; would a&#x27; say; and away again would a&#x27; go, and again would a&#x27; come: I shall never see such a fellow.",
        "Of what, lady? of speaking honourably? is not marriage honourable in a beggar? Is not your lord honourable without marriage? I think you would have me say, &#x27;saving your reverence, a husband:&#x27; an bad thinking do not wrest true speaking, I&#x27;ll offend nobody. Is there any harm in &#x27;the heavier for a husband?&#x27; None, I think, an it be the right husband and the right wife; otherwise &#x27;tis light, and not heavy: ask my Lady Beatrice else; here she comes.<br/><br/>Good morrow, coz.<br/><br/>Good morrow, sweet Hero.<br/><br/>Why, how now! do you speak in the sick tune?",
        "Well, I am school&#x27;d; good manners be your speed!<br/>Here come our wives, and let us take our leave.<br/><br/>This is the deadly spite that angers me,<br/>My wife can speak no English, I no Welsh.<br/><br/>My daughter weeps; she will not part with you:<br/>She&#x27;ll be a soldier too: she&#x27;ll to the wars.<br/><br/>Good father, tell her that she and my aunt Percy,",
        "Dionyza doth appear,<br/>With Leonine, a murderer.<br/><br/>Thy oath remember; thou hast sworn to do &#x27;t:<br/>&#x27;Tis but a blow, which never shall be known.<br/>Thou canst not do a thing i&#x27; the world so soon,<br/>To yield thee so much profit. Let not conscience,<br/>Which is but cold, inflaming love i&#x27; thy bosom,<br/>Inflame too nicely; nor let pity, which<br/>Even women have cast off, melt thee, but he",
        "Here comes your father; tell him so yourself,<br/>And see how he will take it at your hands.<br/><br/>When the sun sets, the air doth drizzle dew;<br/>But for the sunset of my brother&#x27;s son<br/>It rains downright.<br/>How now! a conduit, girl? what! still in tears?<br/>Evermore showering? In one little body<br/>Thou counterfeit&#x27;st a bark, a sea, a wind;<br/>For still thy eyes, which I may call the sea,",
        "No, nor to-morrow, nor till I please myself,<br/>The door is open, sir, there lies your way;<br/>You may be jogging whiles your boots are green;<br/>For me, I&#x27;ll not be gone till I please myself.<br/>&#x27;Tis like you&#x27;ll prove a jolly surly groom,<br/>That take it on you at the first so roundly.<br/><br/>O Kate! content thee: prithee, be not angry.<br/><br/>I will be angry: what hast thou to do?",
        "With one appearing hair, that will not follow<br/>Those call&#x27;d and choice-drawn cavaliers to France?<br/>Work, work your thoughts, and therein see a siege;<br/>Behold the ordenance on their carriages,<br/>With fatal mouths gaping on girded Harfleur.<br/>Suppose the ambassador from the French comes back;<br/>Tells Harry that the king doth offer him<br/>Katharine his daughter; and with her, to dowry,<br/>Some petty and unprofitable dukedoms:<br/>The offer likes not: and the nimble gunner",
        "Between our statures: she hath urg&#x27;d her height;<br/>And with her personage, her tall personage,<br/>Her height, forsooth, she hath prevail&#x27;d with him.<br/>And are you grown so high in his esteem,<br/>Because I am so dwarfish and so low?<br/>How low am I, thou painted maypole? speak;<br/>How low am I? I am not yet so low<br/>But that my nails can reach unto thine eyes.<br/><br/>I pray you, though you mock me, gentlemen,",
        "Must gently be preserv&#x27;d, cherish&#x27;d, and kept:<br/>Me seemeth good, that, with some little train,<br/>Forthwith from Ludlow the young prince be fetch&#x27;d<br/>Hither to London, to be crown&#x27;d our king.<br/><br/>Why with some little train, my Lord of Buckingham?<br/><br/>Marry, my lord, lest, by a multitude,<br/>The new-heal&#x27;d wound of malice should break out;<br/>Which would be so much the more dangerous,",
        "Adieu, goodman drivel.<br/><br/>This is the air; that is the glorious sun; This pearl she gave me, I do feel&#x27;t and see&#x27;t;<br/>And though &#x27;tis wonder that enwraps me thus,<br/>Yet &#x27;tis not madness. Where&#x27;s Antonio then?<br/>I could not find him at the Elephant;<br/>Yet there he was, and there I found this credit,<br/>That he did range the town to seek me out.<br/>His counsel now might do me golden service;<br/>For though my soul disputes well with my sense",
        "You are the fount that makes small brooks to flow:<br/>Now stops thy spring; my sea shall suck them dry,<br/>And swell so much the higher by their ebb.<br/>Hence with him to the Tower! let him not speak.<br/><br/>And, lords, towards Coventry bend we our course,<br/>Where peremptory Warwick now remains:<br/>The sun shines hot; and, if we use delay,<br/>Cold biting winter mars our hop&#x27;d-for hay.<br/>",
        "The vasty fields of France? or may we cram<br/>Within this wooden O the very casques<br/>That did affright the air at Agincourt?<br/>O, pardon! since a crooked figure may<br/>Attest in little place a million;<br/>And let us, ciphers to this great accompt,<br/>On your imaginary forces work.<br/>Suppose within the girdle of these walls<br/>Are now confin&#x27;d two mighty monarchies,<br/>Whose high upreared and abutting fronts",
        "And here&#x27;s thy hand, in scorn to thee sent back:<br/>Thy griefs their sports, thy resolution mock&#x27;d;<br/>That woe is me to think upon thy woes,<br/>More than remembrance of my father&#x27;s death.<br/><br/>Now let hot  tna cool in Sicily,<br/>And be my heart an ever burning hell!<br/>These miseries are more than may be borne.<br/>To weep with them that weep doth ease some deal,<br/>But sorrow flouted at is double death.",
        "Too well, too well thou tell&#x27;st a tale so ill.<br/>Where is the Earl of Wiltshire? where is Bagot?<br/>What is become of Bushy? where is Green?<br/>That they have let the dangerous enemy<br/>Measure our confines with such peaceful steps?<br/>If we prevail, their heads shall pay for it.<br/>I warrant they have made peace with Bolingbroke.<br/><br/>Peace have they made with him, indeed, my lord.<br/>",
        "Made promise to the doctor. Now, thus it rests:<br/>Her father means she shall be all in white,<br/>And in that habit, when Slender sees his time<br/>To take her by the hand and bid her go,<br/>She shall go with him: her mother hath intended,<br/>The better to denote her to the doctor,<br/>For they must all be mask&#x27;d and vizarded<br/>That quaint in green she shall be loose enrob&#x27;d,<br/>With ribands pendent, flaring &#x27;bout her head;<br/>And when the doctor spies his vantage ripe,",
        "With the dear love I bear to fair Anne Page;<br/>Who, mutually hath answer&#x27;d my affection,<br/>So far forth as herself might be her chooser,<br/>Even to my wish. I have a letter from her<br/>Of such contents as you will wonder at;<br/>The mirth whereof so larded with my matter,<br/>That neither singly can be manifested,<br/>Without the show of both; wherein fat Falstaff<br/>Hath a great scare: the image of the jest<br/>I&#x27;ll show you here at large",
        "Nay, come, I pray you, sir, give me the chain:<br/>Both wind and tide stays for this gentleman,<br/>And I, to blame, have held him here too long.<br/><br/>Good Lord! you use this dalliance to excuse<br/>Your breach of promise to the Porpentine.<br/>I should have child you for not bringing it,<br/>But, like a shrew, you first begin to brawl.<br/><br/>The hour steals on; I pray you, sir, dispatch.",
        "I&#x27;ll give&#x27;t him.<br/><br/>You may have very fit occasion for for&#x27;t: he is now in some commerce with my lady, and will by and by depart.<br/><br/>Go, Sir Andrew; scout me for him at the corner of the orchard like a bum-baily: so soon as ever thou seest him, draw; and, as thou drawest, swear horrible; for it comes to pass oft that a terrible oath, with a swaggering accent sharply twanged off, gives manhood more approbation than ever proof itself would have earned him. Away!<br/><br/>Nay, let me alone for swearing.<br/><br/>Now will not I deliver his letter: for the behaviour of the young gentleman gives him out to be of good capacity and breeding; his employment between his lord and my niece confirms no less: therefore this letter, being so excellently ignorant, will breed no terror in the youth: he will find it comes from a clodpole. But, sir, I will deliver his challenge by word of mouth; set upon Aguecheek a notable report of valour; and drive the gentleman,as I know his youth will aptly receive it,into a most hideous opinion of his rage, skill, fury, and impetuosity. This will so fright them both that they will kill one another by the look, like cockatrices.",
        "Of all these bounds, even from this line to this,<br/>With shadowy forests and with champains rich&#x27;d,<br/>With plenteous rivers and wide-skirted meads,<br/>We make thee lady: to thine and Albany&#x27;s issue<br/>Be this perpetual. What says our second daughter,<br/>Our dearest Regan, wife to Cornwall? Speak.<br/><br/>I am made of that self metal as my sister,<br/>And prize me at her worth. In my true heart",
        "Thou&#x27;lt torture me to leave unspoken that<br/>Which, to be spoke, would torture thee.<br/><br/>How! me?<br/><br/>I am glad to be constrain&#x27;d to utter that<br/>Which torments me to conceal. By villany<br/>I got this ring; &#x27;twas Leonatus&#x27; jewel,<br/>Whom thou didst banish, and which more may grieve thee,<br/>As it doth me a nobler sir ne&#x27;er liv&#x27;d",
        "Could not all hell afford you such a devil?<br/>For well I wot the empress never wags<br/>But in her company there is a Moor;<br/>And would you represent our queen aright,<br/>It were convenient you had such a devil.<br/>But welcome as you are. What shall we do?<br/><br/>What wouldst thou have us do, Andronicus?<br/><br/>Show me a murderer, I&#x27;ll deal with him.",
        "Grow from the king&#x27;s acquaintance, by this carriage.<br/>The hearts of princes kiss obedience,<br/>So much they love it; but to stubborn spirits<br/>They swell, and grow as terrible as storms.<br/>I know you have a gentle, noble temper,<br/>A soul as even as a calm: pray think us<br/>Those we profess, peace-makers, friends, and servants.<br/><br/>Madam, you&#x27;ll find it so. You wrong your virtues<br/>With these weak women&#x27;s fears: a noble spirit,",
        "She is not worth thee, then. What years, i&#x27; faith?<br/><br/>About your years, my lord.<br/><br/>Too old, by heaven. Let still the woman take<br/>An elder than herself, so wears she to him,<br/>So sways she level in her husband&#x27;s heart:<br/>For, boy, however we do praise ourselves,<br/>Our fancies are more giddy and unfirm,<br/>More longing, wavering, sooner lost and worn,",
        "Look how thou stirrest now! come away, or I&#x27;ll fetch thee with a wannion.<br/><br/>Faith, master, I am thinking of the poor men that were cast away before us even now.<br/><br/>Alas! poor souls; it grieved my heart to hear what pitiful cries they made to us to help them, when, well-a-day, we could scarce help ourselves.<br/><br/>Nay, master, said not I as much when I saw the porpus how he bounced and tumbled? they say they&#x27;re half fish half flesh; a plague on them! they ne&#x27;er come but I look to be washed. Master, I marvel how the fishes live in the sea.",
        "Sir, the Germans desire to have three of your horses: the duke himself will be to-morrow at court, and they are going to meet him.<br/><br/>What duke should that be comes so secretly? I hear not of him in the court. Let me speak with the gentlemen; they speak English?<br/><br/>Ay, sir; I&#x27;ll call them to you.<br/><br/>They shall have my horses, but I&#x27;ll make them pay; I&#x27;ll sauce them: they have had my house a week at command; I have turned away my other guests: they must come off; I&#x27;ll sauce them. Come.<br/><br/>&#x27;Tis one of the pest discretions of a &#x27;oman as ever I did look upon.",
        "And crown you king of this day&#x27;s happiness.<br/><br/>&#x27;Tis more by fortune, lady, than by merit.<br/><br/>Call it by what you will, the day is yours;<br/>And here, I hope, is none that envies it.<br/>In framing an artist art hath thus decreed,<br/>To make some good, but others to exceed;<br/>And you&#x27;re her labour&#x27;d scholar. Come, queen o&#x27; the feast,<br/>For, daughter, so you are,here take your place;",
        "My life, sir, in any case! not that I am afraid to die; but that, my offences being many, I would repent out the remainder of nature. Let me live, sir, in a dungeon, i&#x27; the stocks, or anywhere, so I may live.<br/><br/>We&#x27;ll see what may be done, so you confess freely: therefore, once more to this Captain Dumain. You have answered to his reputation with the duke and to his valour: what is his honesty?<br/><br/>He will steal, sir, an egg out of a cloister; for rapes and ravishments he parallels Nessus; he professes not keeping of oaths; in breaking &#x27;em he is stronger than Hercules; he will lie, sir, with such volubility, that you would think truth were a fool; drunkenness is his best virtue, for he will be swine-drunk, and in his sleep he does little harm, save to his bed-clothes about him; but they know his conditions, and lay him in straw. I have but little more to say, sir, of his honesty: he has everything that an honest man should not have; what an honest man should have, he has nothing.",
        "&#x27;Tis no matter for his swellings nor his turkey-cocks. God pless you, Aunchient Pistol! you scurvy, lousy knave, God pless you!<br/><br/>Ha! art thou bedlam? dost thou thirst, base Troyan,<br/>To have me fold up Parca&#x27;s fatal web?<br/>Hence! I am qualmish at the smell of leek.<br/><br/>I peseech you heartily, scurvy lousy knave, at my desires and my requests and my petitions to eat, look you, this leek; pecause, look you, you do not love it, nor your affections and your appetites and your digestions does not agree with it, I would desire you to eat it.",
        "With sweet rehearsal of my morning&#x27;s dream.<br/><br/>Methought this staff, mine office-badge in court,<br/>Was broke in twain; by whom I have forgot,<br/>But, as I think, it was by the cardinal;<br/>And on the pieces of the broken wand<br/>Were plac&#x27;d the heads of Edmund Duke of Somerset,<br/>And William De la Pole, first Duke of Suffolk.<br/>This was my dream: what it doth bode, God knows.<br/>",
        "That the great body of our state may go<br/>In equal rank with the best govern&#x27;d nation;<br/>That war or peace, or both at once, may be<br/>As things acquainted and familiar to us;<br/>In which you, father, shall have foremost hand.<br/>Our coronation done, we will accite,<br/>As I before remember&#x27;d, all our state:<br/>And, God consigning to my good intents,<br/>No prince nor peer shall have just cause to say,<br/>God shorten Harry&#x27;s happy life one day.",
        "I will preserve myself; and am bethought<br/>To take the basest and most poorest shape<br/>That ever penury, in contempt of man,<br/>Brought near to beast; my face I&#x27;ll grime with filth,<br/>Blanket my loins, elf all my hair in knots,<br/>And with presented nakedness outface<br/>The winds and persecutions of the sky.<br/>The country gives me proof and precedent<br/>Of Bedlam beggars, who with roaring voices,<br/>Strike in their numb&#x27;d and mortified bare arms",
        "Can in this desert place buy entertainment,<br/>Bring us where we may rest ourselves and feed.<br/>Here&#x27;s a young maid with travel much oppress&#x27;d,<br/>And faints for succour.<br/><br/>Fair sir, I pity her,<br/>And wish, for her sake more than for mine own,<br/>My fortunes were more able to relieve her;<br/>But I am shepherd to another man,<br/>And do not shear the fleeces that I graze:",
        "O Buckingham! take heed of yonder dog:<br/>Look, when he fawns, he bites; and when he bites<br/>His venom tooth will rankle to the death:<br/>Have not to do with him, beware of him;<br/>Sin, death and hell have set their marks on him,<br/>And all their ministers attend on him.<br/><br/>What doth she say, my Lord of Buckingham?<br/><br/>Nothing that I respect, my gracious lord.",
        "And quickly will return an injury:<br/>Follow and see there be no harm between them.<br/>Go you with me, uncle of Exeter.<br/><br/>I warrant it is to knight you, captain.<br/><br/>God&#x27;s will and his pleasure, captain, I peseech you now come apace to the king: there is more good toward you peradventure than is in your knowledge to dream of.<br/><br/>Sir, know you this glove?<br/>",
        "Fortune forbid my outside have not charm&#x27;d her!<br/>She made good view of me; indeed, so much,<br/>That sure methought her eyes had lost her tongue,<br/>For she did speak in starts distractedly.<br/>She loves me, sure; the cunning of her passion<br/>Invites me in this churlish messenger.<br/>None of my lord&#x27;s ring! why, he sent her none.<br/>I am the man: if it be so, as &#x27;tis,<br/>Poor lady, she were better love a dream.<br/>Disguise, I see, thou art a wickedness,",
        "So much, dear liege, I have already sworn,<br/>That is, to live and study here three years.<br/>But there are other strict observances;<br/>As, not to see a woman in that term,<br/>Which I hope well is not enrolled there:<br/>And one day in a week to touch no food,<br/>And but one meal on every day beside;<br/>The which I hope is not enrolled there:<br/>And then, to sleep but three hours in the night,<br/>And not be seen to wink of all the day,",
        "What talk you of the posy, or the value?<br/>You swore to me, when I did give it you,<br/>That you would wear it till your hour of death,<br/>And that it should lie with you in your grave:<br/>Though not for me, yet for your vehement oaths,<br/>You should have been respective and have kept it.<br/>Gave it a judge&#x27;s clerk! no, God&#x27;s my judge,<br/>The clerk will ne&#x27;er wear hair on&#x27;s face that had it.<br/><br/>He will, an if he live to be a man.",
        "Fie, what a question&#x27;s that,<br/>If thou wert near a lewd interpreter!<br/>But come: I&#x27;ll tell thee all my whole device<br/>When I am in my coach, which stays for us<br/>At the park gate; and therefore haste away,<br/>For we must measure twenty miles to-day.<br/><br/>Yes, truly; for, look you, the sins of the father are to be laid upon the children; therefore, I promise you, I fear you. I was always plain with you, and so now I speak my agitation of the matter: therefore be of good cheer; for, truly, I think you are damned. There is but one hope in it that can do you any good, and that is but a kind of bastard hope neither.",
        "What ceremony else?<br/><br/>Her obsequies have been as far enlarg&#x27;d<br/>As we have warrantise: her death was doubtful,<br/>And, but that great command o&#x27;ersways the order,<br/>She should in ground unsanctified have lodg&#x27;d<br/>Till the last trumpet; for charitable prayers,<br/>Shards, flints, and pebbles should be thrown on her;<br/>Yet here she is allow&#x27;d her virgin crants,",
        "And all our princes captiv&#x27;d by the hand<br/>Of that black name, Edward Black Prince of Wales;<br/>Whiles that his mounting sire, on mountain standing,<br/>Up in the air, crown&#x27;d with the golden sun,<br/>Saw his heroical seed, and smil&#x27;d to see him<br/>Mangle the work of nature, and deface<br/>The patterns that by God and by French fathers<br/>Had twenty years been made. This is a stem<br/>Of that victorious stock; and let us fear<br/>The native mightiness and fate of him.",
        "Yet I insisted, yet you answer&#x27;d not,<br/>But, with an angry wafture of your hand.<br/>Gave sign for me to leave you. So I did,<br/>Fearing to strengthen that impatience<br/>Which seem&#x27;d too much enkindled, and withal<br/>Hoping it was but an effect of humour,<br/>Which sometime hath his hour with every man.<br/>It will not let you eat, nor talk, nor sleep,<br/>And could it work so much upon your shape<br/>As it hath much prevail&#x27;d on your condition,",
        "Trow you whither I am going? To Baptista Minola.<br/>I promis&#x27;d to inquire carefully<br/>About a schoolmaster for the fair Bianca;<br/>And, by good fortune, I have lighted well<br/>On this young man; for learning and behaviour<br/>Fit for her turn; well read in poetry<br/>And other books, good ones, I warrant ye.<br/><br/>&#x27;Tis well: and I have met a gentleman<br/>Hath promis&#x27;d me to help me to another,",
        "How fondly dost thou spur a forward horse!<br/>If I dare eat, or drink, or breathe, or live,<br/>I dare meet Surrey in a wilderness,<br/>And spit upon him, whilst I say he lies,<br/>And lies, and lies: there is my bond of faith<br/>To tie thee to my strong correction.<br/>As I intend to thrive in this new world,<br/>Aumerle is guilty of my true appeal:<br/>Besides, I heard the banish&#x27;d Norfolk say<br/>That thou, Aumerle, didst send two of thy men",
        "Than stamps in gold or sums in sealed bags;<br/>And &#x27;tis the very riches of thyself<br/>That now I aim at.<br/><br/>Gentle Master Fenton,<br/>Yet seek my father&#x27;s love; still seek it, sir:<br/>If opportunity and humblest suit<br/>Cannot attain it, why, then,hark you hither.<br/><br/>Break their talk, Mistress Quickly: my kinsman shall speak for himself.",
        "And from the powdering-tub of infamy<br/>Fetch forth the lazar kite of Cressid&#x27;s kind,<br/>Doll Tearsheet she by name, and her espouse:<br/>I have, and I will hold, the quondam Quickly<br/>For the only she; and pauca, there&#x27;s enough.<br/>Go to<br/><br/>Mine host Pistol, you must come to my master, and your hostess: he is very sick, and would to bed. Good Bardolph, put thy face between his sheets and do the office of a warming-pan. Faith, he&#x27;s very ill.<br/><br/>Away, you rogue!",
        "A nobler man, a braver warrior,<br/>Lives not this day within the city walls:<br/>He by the senate is accited home<br/>From weary wars against the barbarous Goths;<br/>That, with his sons, a terror to our foes,<br/>Hath yok&#x27;d a nation, strong, train&#x27;d up in arms.<br/>Ten years are spent since first he undertook<br/>This cause of Rome, and chastised with arms<br/>Our enemies&#x27; pride: five times he hath return&#x27;d<br/>Bleeding to Rome, bearing his valiant sons",
        "No matter, since<br/>They have left their viands behind; for we have stomachs.<br/>Will&#x27;t please you to taste of what is here?<br/><br/>Not I.<br/><br/>Faith, sir, you need not fear. When we were boys,<br/>Who would believe that there were mountaineers<br/>Dew-lapp&#x27;d like bulls, whose throats had hanging at them<br/>Wallets of flesh? or that there were such men",
        "Or lose your heart, or your chaste treasure open<br/>To his unmaster&#x27;d importunity.<br/>Fear it, Ophelia, fear it, my dear sister;<br/>And keep you in the rear of your affection,<br/>Out of the shot and danger of desire.<br/>The chariest maid is prodigal enough<br/>If she unmask her beauty to the moon;<br/>Virtue herself &#x27;scapes not calumnious strokes;<br/>The canker galls the infants of the spring<br/>Too oft before their buttons be disclos&#x27;d,",
        "Let me see, let me see; is not the leaf turn&#x27;d down<br/>Where I left reading? Here it is, I think.<br/><br/>How ill this taper burns! Ha! who comes here?<br/>I think it is the weakness of mine eyes<br/>That shapes this monstrous apparition.<br/>It comes upon me. Art thou any thing?<br/>Art thou some god, some angel, or some devil,<br/>That mak&#x27;st my blood cold and my hair to stare?<br/>",
        "In whose comparison all whites are ink,<br/>Writing their own reproach; to whose soft seizure<br/>The cygnet&#x27;s down is harsh, and spirit of sense<br/>Hard as the palm of ploughman: this thou tell&#x27;st me,<br/>As true thou tell&#x27;st me, when I say I love her;<br/>But, saying thus, instead of oil and balm,<br/>Thou lay&#x27;st in every gash that love hath given me<br/>The knife that made it.<br/><br/>I speak no more than truth.",
        "Shall seize one half his goods; the other half<br/>Comes to the privy coffer of the state;<br/>And the offender&#x27;s life lies in the mercy<br/>Of the duke only, &#x27;gainst all other voice.<br/>In which predicament, I say, thou stand&#x27;st;<br/>For it appears by manifest proceeding,<br/>That indirectly and directly too<br/>Thou hast contriv&#x27;d against the very life<br/>Of the defendant; and thou hast incurr&#x27;d<br/>The danger formerly by me rehears&#x27;d.",
        "Pardon me, madam,<br/>I may not go without you to the kings.<br/><br/>Thou mayst, thou shalt: I will not go with thee.<br/>I will instruct my sorrows to be proud;<br/>For grief is proud and makes his owner stoop.<br/>To me and to the state of my great grief<br/>Let kings assemble; for my grief&#x27;s so great<br/>That no supporter but the huge firm earth<br/>Can hold it up: here I and sorrows sit;",
        "Why, we shall make him mad indeed.<br/><br/>The house will be the quieter.<br/><br/>Come, we&#x27;ll have him in a dark room, and bound. My niece is already in the belief that he&#x27;s mad: we may carry it thus, for our pleasure and his penance, till our very pastime, tired out of breath, prompt us to have mercy on him; at which time we will bring the device to the bar, and crown thee for a finder of madmen. But see, but see.<br/><br/>More matter for a May morning.<br/><br/>Here&#x27;s the challenge; read it: I warrant there&#x27;s vinegar and pepper in&#x27;t.",
        "Upon a wretch whose natural gifts were poor<br/>To those of mine!<br/>But virtue, as it never will be mov&#x27;d,<br/>Though lewdness court it in a shape of heaven,<br/>So lust, though to a radiant angel link&#x27;d,<br/>Will sate itself in a celestial bed,<br/>And prey on garbage.<br/>But, soft! methinks I scent the morning air;<br/>Brief let me be. Sleeping within mine orchard,<br/>My custom always in the afternoon,",
        "Good morrow, uncle Pandarus.<br/><br/>Good morrow, cousin Cressid. What do you talk of? Good morrow, Alexander.<br/>How do you, cousin? When were you at Ilium?<br/><br/>This morning, uncle.<br/><br/>What were you talking of when I came? Was Hector armed and gone ere ye came to Ilium? Helen was not up, was she?<br/><br/>Hector was gone, but Helen was not up.",
        "For I was train&#x27;d up in the English court;<br/>Where, being but young, I framed to the harp<br/>Many an English ditty lovely well,<br/>And gave the tongue an helpful ornament;<br/>A virtue that was never seen in you.<br/><br/>Marry, and I&#x27;m glad of it with all my heart.<br/>I had rather be a kitten, and cry mew<br/>Than one of these same metre ballad-mongers;<br/>I had rather hear a brazen canstick turn&#x27;d,",
        "That he&#x27;s not only plagued for her sin,<br/>But God hath made her sin and her the plague<br/>On this removed issue, plagu&#x27;d for her,<br/>And with her plague, her sin; his injury<br/>Her injury, the beadle to her sin,<br/>All punish&#x27;d in the person of this child,<br/>And all for her. A plague upon her!<br/><br/>Thou unadvised scold, I can produce<br/>A will that bars the title of thy son.",
        "Achilles! a drayman, a porter, a very camel.<br/><br/>Well, well.<br/><br/>&#x27;Well, well!&#x27; Why, have you any discretion? have you any eyes? Do you know what a man is? Is not birth, beauty, good shape, discourse, manhood, learning, gentleness, virtue, youth, liberality, and so forth, the spice and salt that season a man?<br/><br/>Ay, a minced man: and then to be baked with no date in the pie, for then the man&#x27;s date&#x27;s out.<br/><br/>You are such a woman! one knows not at what ward you lie.",
        "I am surprised with an uncouth fear;<br/>A chilling sweat o&#x27;erruns my trembling joints:<br/>My heart suspects more than mine eye can see.<br/><br/>To prove thou hast a true-divining heart,<br/>Aaron and thou look down into this den,<br/>And see a fearful sight of blood and death.<br/><br/>Aaron is gone; and my compassionate heart<br/>Will not permit mine eyes once to behold",
        "How, if a&#x27; will not stand?<br/><br/>Why, then, take no note of him, but let him go; and presently call the rest of the watch together, and thank God you are rid of a knave.<br/><br/>If he will not stand when he is bidden, he is none of the prince&#x27;s subjects.<br/><br/>True, and they are to meddle with none but the prince&#x27;s subjects. You shall also make no noise in the streets: for, for the watch to babble and to talk is most tolerable and not to be endured.<br/><br/>We will rather sleep than talk: we know what belongs to a watch.",
        "Nay, good my lord, be not afraid of shadows.<br/><br/>By the apostle Paul, shadows to-night<br/>Have struck more terror to the soul of Richard<br/>Than can the substance of ten thousand soldiers<br/>Armed in proof, and led by shallow Richmond.<br/>It is not yet near day. Come, go with me;<br/>Under our tents I&#x27;ll play the eaves-dropper,<br/>To hear if any mean to shrink from me.",
        "Tell me not, friar, that thou hear&#x27;st of this,<br/>Unless thou tell me how I may prevent it:<br/>If, in thy wisdom, thou canst give no help,<br/>Do thou but call my resolution wise,<br/>And with this knife I&#x27;ll help it presently,<br/>God join&#x27;d my heart and Romeo&#x27;s, thou our hands;<br/>And ere this hand, by thee to Romeo seal&#x27;d,<br/>Shall be the label to another deed,<br/>Or my true heart with treacherous revolt<br/>Turn to another, this shall slay them both.",
        "O balmy breath, that dost almost persuade<br/>Justice to break her sword! One more, one more.<br/>Be thus when thou art dead, and I will kill thee,<br/>And love thee after. One more, and this the last:<br/>So sweet was ne&#x27;er so fatal. I must weep,<br/>But they are cruel tears; this sorrow&#x27;s heavenly,<br/>It strikes where it doth love. She wakes.<br/><br/>Who&#x27;s there? Othello?",
        "What you have charg&#x27;d me with, that have I done,<br/>And more, much more; the time will bring it out:<br/>&#x27;Tis past, and so am I. But what art thou<br/>That hast this fortune on me? If thou&#x27;rt noble,<br/>I do forgive thee.<br/><br/>Let&#x27;s exchange charity.<br/>I am no less in blood than thou art, Edmund;<br/>If more, the more thou hast wrong&#x27;d me.<br/>My name is Edgar, and thy father&#x27;s son.",
        "For three performers are the file when all<br/>The rest do nothing,with this word, &#x27;Stand, stand!&#x27;<br/>Accommodated by the place, more charming<br/>With their own nobleness,which could have turn&#x27;d<br/>A distaff to a lance,gilded pale looks,<br/>Part shame, part spirit renew&#x27;d; that some, turn&#x27;d coward<br/>But by example,O! a sin of war,<br/>Damn&#x27;d in the first beginners,&#x27;gan to look<br/>The way that they did, and to grin like lions<br/>Upon the pikes o&#x27; the hunters. Then began",
        "Thus war hath given thee peace, for thou art still.<br/>Peace with his soul, heaven, if it be thy will!<br/><br/>Shame and confusion! all is on the rout:<br/>Fear frames disorder, and disorder wounds<br/>Where it should guard. O war! thou son of hell,<br/>Whom angry heavens do make their minister,<br/>Throw in the frozen bosoms of our part<br/>Hot coals of vengeance! Let no soldier fly:",
        "And I to live and die her slave.<br/><br/>O most gentle pulpiter! what tedious homily of love have you wearied your parishioners withal, and never cried, &#x27;Have patience, good people!&#x27;<br/><br/>How now! back, friends! Shepherd, go off a little: go with him, sirrah.<br/><br/>Come, shepherd, let us make an honourable retreat; though not with bag and baggage, yet with scrip and scrippage.<br/><br/>Didst thou hear these verses?<br/>",
        "Have read it for restoratives:<br/>The purchase is to make men glorious;<br/>Et bonum quo antiquius, eo melius.<br/>If you, born in these latter times,<br/>When wit&#x27;s more ripe, accept my rimes,<br/>And that to hear an old man sing<br/>May to your wishes pleasure bring,<br/>I life would wish, and that I might<br/>Waste it for you like taper-light.<br/>This Antioch, then, Antiochus the Great",
        "Tell him this tale; and from the mouth of England<br/>Add thus much more: that no Italian priest<br/>Shall tithe or toll in our dominions;<br/>But as we under heaven are supreme head,<br/>So under him that great supremacy,<br/>Where we do reign, we will alone uphold,<br/>Without the assistance of a mortal hand:<br/>So tell the pope; all reverence set apart<br/>To him, and his usurp&#x27;d authority.<br/>",
        "Even to the court, the heart, to the seat o&#x27; the brain;<br/>And, through the cranks and offices of man,<br/>The strongest nerves and small inferior veins<br/>From me receive that natural competency<br/>Whereby they live. And though that all at once,<br/>You, my good friends,&#x27; this says the belly, mark me,<br/><br/>Ay, sir; well, well.<br/><br/>&#x27;Though all at once cannot",
        "Why now; as fast as she can marry us.<br/><br/>Then you must say, &#x27;I take thee, Rosalind, for wife.&#x27;<br/><br/>I take thee, Rosalind, for wife.<br/><br/>I might ask you for your commission; but, I do take thee, Orlando, for my husband: there&#x27;s a girl goes before the priest; and, certainly, a woman&#x27;s thought runs before her actions.<br/><br/>So do all thoughts; they are winged.",
        "In all my writings. Go with me, and see<br/>What I can show in this.<br/><br/>My desolation does begin to make<br/>A better life. &#x27;Tis paltry to be C sar;<br/>Not being Fortune, he&#x27;s but Fortune&#x27;s knave,<br/>A minister of her will; and it is great<br/>To do that thing that ends all other deeds,<br/>Which shackles accidents, and bolts up change,<br/>Which sleeps, and never palates more the dug,",
        "And an ill singer, my lord.<br/><br/>Ha, no, no, faith; thou singest well enough for a shift.<br/><br/>An he had been a dog that should have howled thus, they would have hanged him; and I pray God his bad voice bode no mischief. I had as lief have heard the night-raven, come what plague could have come after it.<br/><br/>Yea, marry; dost thou hear, Balthazar? I pray thee, get us some excellent music, for to-morrow night we would have it at the Lady Hero&#x27;s chamber-window.<br/><br/>The best I can, my lord.",
        "Brav&#x27;d in mine own house with a skein of thread!<br/>Away! thou rag, thou quantity, thou remnant,<br/>Or I shall so be-mete thee with thy yard<br/>As thou shalt think on prating whilst thou liv&#x27;st!<br/>I tell thee, I, that thou hast marr&#x27;d her gown.<br/><br/>Your worship is deceiv&#x27;d: the gown is made<br/>Just as my master had direction.<br/>Grumio gave order how it should be done.<br/>",
        "By my troth, a good song.<br/><br/>And an ill singer, my lord.<br/><br/>Ha, no, no, faith; thou singest well enough for a shift.<br/><br/>An he had been a dog that should have howled thus, they would have hanged him; and I pray God his bad voice bode no mischief. I had as lief have heard the night-raven, come what plague could have come after it.<br/><br/>Yea, marry; dost thou hear, Balthazar? I pray thee, get us some excellent music, for to-morrow night we would have it at the Lady Hero&#x27;s chamber-window.",
        "With this strict charge, even as he left his life,<br/>&#x27;Keep it, my Pericles, it hath been a shield<br/>&#x27;Twixt me and death;&#x27; and pointed to this brace;<br/>&#x27;For that it sav&#x27;d me, keep it; in like necessity<br/>The which the gods protect thee from!&#x27;t may defend thee.&#x27;<br/>It kept where I kept, I so dearly lov&#x27;d it;<br/>Till the rough seas, that spare not any man,<br/>Took it in rage, though calm&#x27;d they have given &#x27;t again.<br/>I thank thee for &#x27;t; my shipwrack now &#x27;s no ill,<br/>Since I have here my father&#x27;s gift in &#x27;s will.",
        "There is a word will Priam turn to stone,<br/>Make wells and Niobes of the maids and wives,<br/>Cold statues of the youth; and, in a word,<br/>Scare Troy out of itself. But march away:<br/>Hector is dead; there is no more to say.<br/>Stay yet. You vile abominable tents,<br/>Thus proudly pight upon our Phrygian plains,<br/>Let Titan rise as early as he dare,<br/>I&#x27;ll through and through you! And, thou great-siz&#x27;d coward,<br/>No space of earth shall sunder our two hates:",
        "Out of the shot and danger of desire.<br/>The chariest maid is prodigal enough<br/>If she unmask her beauty to the moon;<br/>Virtue herself &#x27;scapes not calumnious strokes;<br/>The canker galls the infants of the spring<br/>Too oft before their buttons be disclos&#x27;d,<br/>And in the morn and liquid dew of youth<br/>Contagious blastments are most imminent.<br/>Be wary then; best safety lies in fear:<br/>Youth to itself rebels, though none else near.",
        "Here cousin,<br/>On this side my hand and on that side thine.<br/>Now is this golden crown like a deep well<br/>That owes two buckets filling one another;<br/>The emptier ever dancing in the air,<br/>The other down, unseen and full of water:<br/>That bucket down and full of tears am I,<br/>Drinking my griefs, whilst you mount up on high.<br/><br/>I thought you had been willing to resign.",
        "With silence, nephew, be thou politic:<br/>Strong-fixed is the house of Lancaster,<br/>And like a mountain, not to be remov&#x27;d.<br/>But now thy uncle is removing hence,<br/>As princes do their courts, when they are cloy&#x27;d<br/>With long continuance in a settled place.<br/><br/>O uncle! would some part of my young years<br/>Might but redeem the passage of your age.",
        "Farewell to your worship.<br/><br/>Truly, an honest gentleman: but Anne loves him not; for I know Anne&#x27;s mind as well as another does. Out upon&#x27;t! what have I forgot?<br/><br/>What! have I &#x27;scaped love-letters in the holiday-time of my beauty, and am I now a subject for them? Let me see.<br/><br/>Ask me no reason why I love you; for though Love use Reason for his physician, he admits him not for his counsellor. You are not young, no more am I; go to then, there&#x27;s sympathy; you are merry, so am I, ha! ha! then, there&#x27;s more sympathy, you love sack, and so do I, would you desire better sympathy? Let it suffice thee, Mistress Page, at the least, if the love of a soldier can suffice, that I love thee I will not say, pity me,&#x27;tis not a soldier-like phrase; but I say, love me. By me,",
        "And, after many lengthen&#x27;d hours of grief,<br/>Die neither mother, wife, nor England&#x27;s queen!<br/>Rivers, and Dorset, you were standers by,<br/>And so wast thou, Lord Hastings,when my son<br/>Was stabb&#x27;d with bloody daggers: God, I pray him,<br/>That none of you may live your natural age,<br/>But by some unlook&#x27;d accident cut off.<br/><br/>Have done thy charm, thou hateful wither&#x27;d hag!<br/>",
        "John lays you plots; the times conspire with you;<br/>For he that steeps his safety in true blood<br/>Shall find but bloody safety and untrue.<br/>This act so evilly borne shall cool the hearts<br/>Of all his people and freeze up their zeal,<br/>That none so small advantage shall step forth<br/>To check his reign, but they will cherish it;<br/>No natural exhalation in the sky,<br/>No scope of nature, no distemper&#x27;d day,<br/>No common wind, no customed event,",
        "What business, lord, so early?<br/><br/>I was sent for to the king; but why, I know not.<br/><br/>His purpose meets you: &#x27;twas to bring this Greek<br/>To Calchas&#x27; house, and there to render him,<br/>For the enfreed Antenor, the fair Cressid.<br/>Let&#x27;s have your company; or, if you please,<br/>Haste there before us. I constantly do think<br/>Or rather, call my thought a certain knowledge",
        "Be blind with tears, and break o&#x27;ercharg&#x27;d with grief.<br/><br/>Thou that so stoutly hast resisted me,<br/>Give me thy gold, if thou hast any gold,<br/>For I have bought it with a hundred blows.<br/>But let me see: is this our foeman&#x27;s face?<br/>Ah! no, no, no, it is mine only son.<br/>Ah! boy, if any life be left in thee,<br/>Throw up thine eye: see, see! what showers arise,<br/>Blown with the windy tempest of my heart,",
        "To undergo with me an enterprise<br/>Of honourable-dangerous consequence;<br/>And I do know by this they stay for me<br/>In Pompey&#x27;s porch: for now, this fearful night,<br/>There is no stir, or walking in the streets;<br/>And the complexion of the element<br/>In favour&#x27;s like the work we have in hand,<br/>Most bloody, fiery, and most terrible.<br/><br/>Stand close awhile, for here comes one in haste.",
        "Upon condition I may quietly<br/>Enjoy mine own, the county Maine and Anjou,<br/>Free from oppression or the stroke of war,<br/>My daughter shall be Henry&#x27;s if he please.<br/><br/>That is her ransom; I deliver her;<br/>And those two counties I will undertake<br/>Your Grace shall well and quietly enjoy.<br/><br/>And I again, in Henry&#x27;s royal name,",
        "Therefore, fair Hermia, question your desires;<br/>Know of your youth, examine well your blood,<br/>Whe&#x27;r, if you yield not to your father&#x27;s choice,<br/>You can endure the livery of a nun,<br/>For aye to be in shady cloister mew&#x27;d,<br/>To live a barren sister all your life,<br/>Chanting faint hymns to the cold fruitless moon.<br/>Thrice blessed they that master so their blood,<br/>To undergo such maiden pilgrimage;<br/>But earthlier happy is the rose distill&#x27;d,",
        "Did, as heir general, being descended<br/>Of Blithild, which was daughter to King Clothair,<br/>Make claim and title to the crown of France.<br/>Hugh Capet also, who usurp&#x27;d the crown<br/>Of Charles the Duke of Loraine, sole heir male<br/>Of the true line and stock of Charles the Great,<br/>To find his title with some shows of truth,<br/>Though in pure truth, it was corrupt and naught,<br/>Convey&#x27;d himself as heir to the Lady Lingare,<br/>Daughter to Charlemain, who was the son",
        "A murrain on&#x27;t! I took this for silver.<br/><br/>See here these movers that do prize their hours<br/>At a crack&#x27;d drachme! Cushions, leaden spoons,<br/>Irons of a doit, doublets that hangmen would<br/>Bury with those that wore them, these base slaves,<br/>Ere yet the fight be done, pack up. Down with them!<br/>And hark, what noise the general makes! To him!<br/>There is the man of my soul&#x27;s hate, Aufidius,",
        "As I told thee before, I am subject to a tyrant, a sorcerer, that by his cunning hath cheated me of the island.<br/><br/>Thou liest.<br/><br/>Thou liest, thou jesting monkey thou;<br/>I would my valiant master would destroy thee;<br/>I do not lie.<br/><br/>Trinculo, if you trouble him any more in his tale, by this hand, I will supplant some of your teeth.",
        "The fair, the chaste, and unexpressive she.<br/><br/>And how like you this shepherd&#x27;s life, Master Touchstone?<br/><br/>Truly, shepherd, in respect of itself, it is a good life; but in respect that it is a shepherd&#x27;s life, it is naught. In respect that it is solitary, I like it very well; but in respect that it is private, it is a very vile life. Now, in respect it is in the fields, it pleaseth me well; but in respect it is not in the court, it is tedious. As it is a spare life, look you, it fits my humour well; but as there is no more plenty in it, it goes much against my stomach. Hast any philosophy in thee, shepherd?",
        "Her chamber is aloft, far from the ground,<br/>And built so shelving that one cannot climb it<br/>Without apparent hazard of his life.<br/><br/>Why then, a ladder quaintly made of cords,<br/>To cast up, with a pair of anchoring hooks,<br/>Would serve to scale another Hero&#x27;s tower,<br/>So bold Leander would adventure it.<br/><br/>Now, as thou art a gentleman of blood,",
        "Shook down my mellow hangings, nay, my leaves,<br/>And left me bare to weather.<br/><br/>Uncertain favour!<br/><br/>My fault being nothing,as I have told you oft,<br/>But that two villains, whose false oaths prevail&#x27;d<br/>Before my perfect honour, swore to Cymbeline<br/>I was confederate with the Romans; so<br/>Follow&#x27;d my banishment, and this twenty years",
        "What title hast thou, traitor, to the crown?<br/>Thy father was, as thou art, Duke of York;<br/>Thy grandfather, Roger Mortimer, Earl of March;<br/>I am the son of Henry the Fifth,<br/>Who made the Dauphin and the French to stoop,<br/>And seiz&#x27;d upon their towns and provinces.<br/><br/>Talk not of France, sith thou hast lost it all.<br/><br/>The Lord Protector lost it, and not I:",
        "If you love her you cannot see her.<br/><br/>Why?<br/><br/>Because Love is blind. O! that you had mine eyes; or your own eyes had the lights they were wont to have when you chid at Sir Proteus for going ungartered!<br/><br/>What should I see then?<br/><br/>Your own present folly and her passing deformity: for he, being in love, could not see to garter his hose; and you, being in love, cannot see to put on your hose.<br/>",
        "You strain too far.<br/>I rather of his absence make this use:<br/>It lends a lustre and more great opinion,<br/>A larger dare to our great enterprise,<br/>Than if the earl were here; for men must think,<br/>If we without his help, can make a head<br/>To push against the kingdom, with his help<br/>We shall o&#x27;erturn it topsy-turvy down.<br/>Yet all goes well, yet all our joints are whole.",
        "Copp&#x27;d hills towards heaven, to tell the earth is throng&#x27;d<br/>By man&#x27;s oppression; and the poor worm doth die for &#x27;t.<br/>Kings are earth&#x27;s gods; in vice their law&#x27;s their will;<br/>And if Jove stray, who dares say Jove doth ill?<br/>It is enough you know; and it is fit,<br/>What being more known grows worse, to smother it.<br/>All love the womb that their first being bred,<br/>Then give my tongue like leave to love my head.<br/><br/>Heaven! that I had thy head; he has found the meaning;",
        "Should all but answer for that peevish brat?<br/>Can curses pierce the clouds and enter heaven?<br/>Why then, give way, dull clouds, to my quick curses!<br/>Though not by war, by surfeit die your king,<br/>As ours by murder, to make him a king!<br/>Edward, thy son, that now is Prince of Wales,<br/>For Edward, my son, which was Prince of Wales,<br/>Die in his youth by like untimely violence!<br/>Thyself a queen, for me that was a queen,<br/>Outlive thy glory, like my wretched self!",
        "All murder&#x27;d: for within the hollow crown<br/>That rounds the mortal temples of a king<br/>Keeps Death his court, and there the antick sits,<br/>Scoffing his state and grinning at his pomp;<br/>Allowing him a breath, a little scene,<br/>To monarchize, be fear&#x27;d, and kill with looks,<br/>Infusing him with self and vain conceit<br/>As if this flesh which walls about our life<br/>Were brass impregnable; and humour&#x27;d thus<br/>Comes at the last, and with a little pin",
        "And from her jealous arms pluck him perforce.<br/><br/>My Lord of Buckingham, if my weak oratory<br/>Can from his mother win the Duke of York,<br/>Anon expect him here; but if she be obdurate<br/>To mild entreaties, God in heaven forbid<br/>We should infringe the holy privilege<br/>Of blessed sanctuary! not for all this land<br/>Would I be guilty of so great a sin.<br/>",
        "I will, my hege.<br/><br/>Now, Hal, what time of day is it, lad?<br/><br/>Thou art so fat-witted, with drinking of old sack, and unbuttoning thee after supper, and sleeping upon benches after noon, that thou hast forgotten to demand that truly which thou wouldst truly know. What a devil hast thou to do with the time of the day? unless hours were cups of sack, and minutes capons, and clocks the tongues of bawds, and dials the signs of leaping-houses, and the blessed sun himself a fair hot wench in flame-colour&#x27;d taffeta, I see no reason why thou shouldst be so superfluous to demand the time of the day.",
        "Heaven, from thy endless goodness, send prosperous life, long, and ever happy, to the high and mighty Princess of England, Elizabeth!<br/><br/>And to your royal Grace, and the good queen,<br/>My noble partners, and myself, thus pray:<br/>All comfort, joy, in this most gracious lady,<br/>Heaven ever laid up to make parents happy,<br/>May hourly fall upon ye!<br/><br/>Thank you, good lord archbishop:",
        "O, pardon! since a crooked figure may<br/>Attest in little place a million;<br/>And let us, ciphers to this great accompt,<br/>On your imaginary forces work.<br/>Suppose within the girdle of these walls<br/>Are now confin&#x27;d two mighty monarchies,<br/>Whose high upreared and abutting fronts<br/>The perilous narrow ocean parts asunder:<br/>Piece out our imperfections with your thoughts:<br/>Into a thousand parts divide one man,",
        "With that all laugh&#x27;d and clapp&#x27;d him on the shoulder,<br/>Making the bold wag by their praises bolder.<br/>One rubb&#x27;d his elbow thus, and fleer&#x27;d, and swore<br/>A better speech was never spoke before;<br/>Another, with his finger and his thumb,<br/>Cry&#x27;d &#x27;Via! we will do&#x27;t, come what will come;&#x27;<br/>The third he caper&#x27;d and cried, &#x27;All goes well;&#x27;<br/>The fourth turn&#x27;d on the toe, and down he fell.<br/>With that, they all did tumble on the ground,<br/>With such a zealous laughter, so profound,",
        "May be he will not touch young Arthur&#x27;s life,<br/>But hold himself safe in his prisonment.<br/><br/>O! sir, when he shall hear of your approach,<br/>If that young Arthur be not gone already,<br/>Even at that news he dies; and then the hearts<br/>Of all his people shall revolt from him<br/>And kiss the lips of unacquainted change,<br/>And pick strong matter of revolt and wrath",
        "She is too subtle for thee; and her smoothness,<br/>Her very silence and her patience,<br/>Speak to the people, and they pity her.<br/>Thou art a fool: she robs thee of thy name;<br/>And thou wilt show more bright and seem more virtuous<br/>When she is gone. Then open not thy lips:<br/>Firm and irrevocable is my doom<br/>Which I have pass&#x27;d upon her; she is banish&#x27;d.<br/><br/>Pronounce that sentence then, on me, my liege:",
        "Nor the prevention of poor Bolingbroke<br/>About his marriage, nor my own disgrace,<br/>Have ever made me sour my patient cheek,<br/>Or bend one wrinkle on my sovereign&#x27;s face.<br/>I am the last of noble Edward&#x27;s sons,<br/>Of whom thy father, Prince of Wales, was first;<br/>In war was never lion rag&#x27;d more fierce,<br/>In peace was never gentle lamb more mild,<br/>Than was that young and princely gentleman.<br/>His face thou hast, for even so look&#x27;d he,",
        "Until your lordship came to see his end;<br/>Which now the loving haste of these our friends,<br/>Something against our meaning, hath prevented:<br/>Because, my lord, we would have had you heard<br/>The traitor speak, and timorously confess<br/>The manner and the purpose of his treason;<br/>That you might well have signified the same<br/>Unto the citizens, who haply may<br/>Misconster us in him, and wail his death.<br/>",
        "Bring them before us.<br/><br/>To be thus is nothing;<br/>But to be safely thus. Our fears in Banquo<br/>Stick deep, and in his royalty of nature<br/>Reigns that which would be fear&#x27;d: &#x27;tis much he dares,<br/>And, to that dauntless temper of his mind,<br/>He hath a wisdom that doth guide his valour<br/>To act in safety. There is none but he",
        "&#x27;Tis thought the king is dead: we will not stay.<br/>The bay-trees in our country are all wither&#x27;d<br/>And meteors fright the fixed stars of heaven,<br/>The pale-fac&#x27;d moon looks bloody on the earth<br/>And lean-look&#x27;d prophets whisper fearful change,<br/>Rich men look sad and ruffians dance and leap,<br/>The one in fear to lose what they enjoy,<br/>The other to enjoy by rage and war:<br/>These signs forerun the death or fall of kings.",
        "For hear her but exampled by herself:<br/>When all her chivalry hath been in France<br/>And she a mourning widow of her nobles,<br/>She hath herself not only well defended,<br/>But taken and impounded as a stray<br/>The King of Scots; whom she did send to France,<br/>To fill King Edward&#x27;s fame with prisoner kings,<br/>And make your chronicle as rich with praise<br/>As is the owse and bottom of the sea<br/>With sunken wrack and sumless treasuries.",
        "As hush as death, anon the dreadful thunder<br/>Doth rend the region; so, after Pyrrhus&#x27; pause,<br/>Aroused vengeance sets him new a-work;<br/>And never did the Cyclops&#x27; hammers fall<br/>On Mars&#x27;s armour, forg&#x27;d for proof eterne,<br/>With less remorse than Pyrrhus&#x27; bleeding sword<br/>Now falls on Priam.<br/>Out, out, thou strumpet, Fortune! All you gods,<br/>In general synod, take away her power;<br/>Break all the spokes and fellies from her wheel,",
        "A mole cinque-spotted, like the crimson drops<br/>I&#x27; the bottom of a cowslip: here&#x27;s a voucher;<br/>Stronger than ever law could make: this secret<br/>Will force him think I have pick&#x27;d the lock and ta&#x27;en<br/>The treasure of her honour. No more. To what end?<br/>Why should I write this down, that&#x27;s riveted,<br/>Screw&#x27;d to my memory? She hath been reading late<br/>The tale of Tereus; here the leaf&#x27;s turn&#x27;d down<br/>Where Philomel gave up. I have enough:<br/>To the trunk again, and shut the spring of it.",
        "You are gentlemen of brave mettle: you would lift the moon out of her sphere, if she would continue in it five weeks without changing.<br/><br/>We would so, and then go a-bat-fowling.<br/><br/>Nay, good my lord, be not angry.<br/><br/>No, I warrant you; I will not adventure my discretion so weakly. Will you laugh me asleep, for I am very heavy?<br/><br/>Go sleep, and hear us.",
        "Speak, Lavinia, what accursed hand<br/>Hath made thee handless in thy father&#x27;s sight?<br/>What fool hath added water to the sea,<br/>Or brought a faggot to bright-burning Troy?<br/>My grief was at the height before thou cam&#x27;st;<br/>And now, like Nilus, it disdaineth bounds.<br/>Give me a sword, I&#x27;ll chop off my hands too;<br/>For they have fought for Rome, and all in vain;<br/>And they have nurs&#x27;d this woe, in feeding life;<br/>In bootless prayer have they been held up,",
        "Else none at all in aught proves excellent.<br/>Then fools you were these women to forswear,<br/>Or, keeping what is sworn, you will prove fools.<br/>For wisdom&#x27;s sake, a word that all men love,<br/>Or for love&#x27;s sake, a word that loves all men,<br/>Or for men&#x27;s sake, the authors of these women;<br/>Or women&#x27;s sake, by whom we men are men,<br/>Let us once lose our oaths to find ourselves,<br/>Or else we lose ourselves to keep our oaths.<br/>It is religion to be thus forsworn;",
        "Ay, by my faith, they shall not be changed yet.<br/><br/>Boult, spend thou that in the town; report what a sojourner we have; you&#x27;ll lose nothing by custom. When nature framed this piece, she meant thee a good turn; therefore say what a paragon she is, and thou hast the harvest out of thine own report.<br/><br/>I warrant you, mistress, thunder shall not so awake the beds of eels as my giving out her beauty stir up the lewdly-inclined. I&#x27;ll bring home some to-night.<br/><br/>Come your ways; follow me.<br/><br/>If fires be hot, knives sharp, or waters deep,",
        "Speak, Rome&#x27;s dear friend, as erst our ancestor,<br/>When with his solemn tongue he did discourse<br/>To love-sick Dido&#x27;s sad attending ear<br/>The story of that baleful burning night<br/>When subtle Greeks surpris&#x27;d King Priam&#x27;s Troy;<br/>Tell us what Sinon hath bewitch&#x27;d our ears,<br/>Or who hath brought the fatal engine in<br/>That gives our Troy, our Rome, the civil wound.<br/>My heart is not compact of flint nor steel,<br/>Nor can I utter all our bitter grief,",
        "Of thee thyself, and all thy complices,<br/>Edward will always bear himself as king:<br/>Though Fortune&#x27;s malice overthrow my state,<br/>My mind exceeds the compass of her wheel.<br/><br/>Then, for his mind, be Edward England&#x27;s king:<br/><br/>But Henry now shall wear the English crown,<br/>And be true king indeed, thou but the shadow.<br/>My Lord of Somerset, at my request,",
        "When went there by an age, since the great flood,<br/>But it was fam&#x27;d with more than with one man?<br/>When could they say, till now, that talk&#x27;d of Rome,<br/>That her wide walls encompass&#x27;d but one man?<br/>Now is it Rome indeed and room enough,<br/>When there is in it but one only man.<br/>O! you and I have heard our fathers say,<br/>There was a Brutus once that would have brook&#x27;d<br/>Th&#x27; eternal devil to keep his state in Rome<br/>As easily as a king.",
        "For who would bear the whips and scorns of time,<br/>The oppressor&#x27;s wrong, the proud man&#x27;s contumely,<br/>The pangs of dispriz&#x27;d love, the law&#x27;s delay,<br/>The insolence of office, and the spurns<br/>That patient merit of the unworthy takes,<br/>When he himself might his quietus make<br/>With a bare bodkin? who would fardels bear,<br/>To grunt and sweat under a weary life,<br/>But that the dread of something after death,<br/>The undiscover&#x27;d country from whose bourn",
        "Come, I will go drink with you, but I cannot tarry dinner. I am glad to see you, by my troth, Master Shallow.<br/><br/>O, Sir John, do you remember since we lay all night in the windmill in Saint George&#x27;s fields?<br/><br/>No more of that, good Master Shallow, no more of that.<br/><br/>Ha! it was a merry night. And is Jane Nightwork alive?<br/><br/>She lives, Master Shallow.",
        "Why, then we rack the value, then we find<br/>The virtue that possession would not show us<br/>Whiles it was ours. So will it fare with Claudio:<br/>When he shall hear she died upon his words,<br/>The idea of her life shall sweetly creep<br/>Into his study of imagination,<br/>And every lovely organ of her life<br/>Shall come apparell&#x27;d in more precious habit,<br/>More moving-delicate, and full of life<br/>Into the eye and prospect of his soul,",
        "Interprets for my poor ignorance.<br/><br/>Here lies a wretched corse, of wretched soul bereft:<br/>Seek not my name: a plague consume you wicked caitiffs left!<br/>Here lie I, Timon; who, alive, all living men did hate:<br/>Pass by, and curse thy fill; but pass and stay not here thy gait.<br/>These well express in thee thy latter spirits:<br/>Though thou abhorr&#x27;dst in us our human griefs,<br/>Scorn&#x27;dst our brain&#x27;s flow and those our droplets which<br/>From niggard nature fall, yet rich conceit",
        "Ay, with my dagger in their bosoms, grandsire.<br/><br/>No, boy, not so; I&#x27;ll teach thee another course.<br/>Lavinia, come. Marcus, look to my house;<br/>Lucius and I&#x27;ll go brave it at the court:<br/>Ay, marry, will we, sir; and we&#x27;ll be waited on.<br/><br/>O heavens! can you hear a good man groan,<br/>And not relent or not compassion him?<br/>Marcus, attend him in his ecstasy,",
        "When thou dost ask me blessing, I&#x27;ll kneel down,<br/>And ask of thee forgiveness: so we&#x27;ll live,<br/>And pray, and sing, and tell old tales, and laugh<br/>At gilded butterflies, and hear poor rogues<br/>Talk of court news; and we&#x27;ll talk with them too,<br/>Who loses and who wins; who&#x27;s in, who&#x27;s out;<br/>And take upon&#x27;s the mystery of things,<br/>As if we were God&#x27;s spies: and we&#x27;ll wear out,<br/>In a wall&#x27;d prison, packs and sets of great ones<br/>That ebb and flow by the moon.",
        "With these weak women&#x27;s fears: a noble spirit,<br/>As yours was put into you, ever casts<br/>Such doubts, as false coin, from it. The king loves you;<br/>Beware you lose it not: for us, if you please<br/>To trust us in your business, we are ready<br/>To use our utmost studies in your service.<br/><br/>Do what ye will, my lords: and, pray, forgive me<br/>If I have us&#x27;d myself unmannerly.<br/>You know I am a woman, lacking wit",
        "Ay, sir; but I am sure I do not; and whatsoever a man denies, you are now bound to believe him.<br/><br/>Not know my voice! O, time&#x27;s extremity,<br/>Hast thou so crack&#x27;d and splitted my poor tongue<br/>In seven short years, that here my only son<br/>Knows not my feeble key of untun&#x27;d cares?<br/>Though now this grained face of mine be hid<br/>In sap-consuming winter&#x27;s drizzled snow,<br/>And all the conduits of my blood froze up,<br/>Yet hath my night of life some memory,",
        "And can do nought but wail her darling&#x27;s loss;<br/>Even so myself bewails good Gloucester&#x27;s case,<br/>With sad unhelpful tears, and with dimm&#x27;d eyes<br/>Look after him, and cannot do him good;<br/>So mighty are his vowed enemies.<br/>His fortunes I will weep; and, &#x27;twixt each groan,<br/>Say &#x27;Who&#x27;s a traitor, Gloucester he is none.&#x27;<br/><br/>Fair lords, cold snow melts with the sun&#x27;s hot beams.<br/>Henry my lord is cold in great affairs,",
        "Therefore let Benedick, like cover&#x27;d fire,<br/>Consume away in sighs, waste inwardly:<br/>It were a better death than die with mocks,<br/>Which is as bad as die with tickling.<br/><br/>Yet tell her of it: hear what she will say.<br/><br/>No; rather I will go to Benedick,<br/>And counsel him to fight against his passion.<br/>And, truly, I&#x27;ll devise some honest slanders",
        "Thou wretched, rash, intruding fool, farewell!<br/>I took thee for thy better; take thy fortune;<br/>Thou find&#x27;st to be too busy is some danger.<br/>Leave wringing of your hands: peace! sit you down,<br/>And let me wring your heart; for so I shall<br/>If it be made of penetrable stuff,<br/>If damned custom have not brass&#x27;d it so<br/>That it is proof and bulwark against sense<br/><br/>What have I done that thou dar&#x27;st wag thy tongue",
        "Why, then you should discover a brace of unmeriting, proud, violent, testy magistrates alias fools as any in Rome.<br/><br/>Menenius, you are known well enough too.<br/><br/>I am known to be a humorous patrician, and one that loves a cup of hot wine with not a drop of allaying Tiber in&#x27;t; said to be something imperfect in favouring the first complaint; hasty and tinder-like upon too trivial motion; one that converses more with the buttock of the night than with the forehead of the morning. What I think I utter, and spend my malice in my breath. Meeting two such wealsmen as you are,I cannot call you Lycurguses,if the drink you give me touch my palate adversely, I make a crooked face at it. I cannot say your worships have delivered the matter well when I find the ass in compound with the major part of your syllables; and though I must be content to bear with those that say you are reverend grave men, yet they lie deadly that tell you have good faces. If you see this in the map of my microcosm, follows it that I am known well enough too? What harm can your bisson conspectuities glean out of this character, if I be known well enough too?",
        "For that same word, rebellion, did divide<br/>The action of their bodies from their souls;<br/>And they did fight with queasiness, constrain&#x27;d,<br/>As men drink potions, that their weapons only<br/>Seem&#x27;d on our side: but, for their spirits and souls,<br/>This word, rebellion, it had froze them up,<br/>As fish are in a pond. But now the bishop<br/>Turns insurrection to religion:<br/>Suppos&#x27;d sincere and holy in his thoughts,<br/>He&#x27;s follow&#x27;d both with body and with mind,",
        "I will be married to a wealthy widow<br/>Ere three days pass, which hath as long lov&#x27;d me<br/>As I have lov&#x27;d this proud disdainful haggard.<br/>And so farewell, Signior Lucentio.<br/>Kindness in women, not their beauteous looks,<br/>Shall win my love: and so I take my leave,<br/>In resolution as I swore before.<br/><br/>Mistress Bianca, bless you with such grace<br/>As &#x27;longeth to a lover&#x27;s blessed case!",
        "Go to: what quality are they of? Elbow is your name? why dost thou not speak, Elbow?<br/><br/>He cannot, sir: he&#x27;s out at elbow.<br/><br/>What are you, sir?<br/><br/>He, sir! a tapster, sir; parcel-bawd; one that serves a bad woman, whose house, sir, was, as they say, plucked down in the suburbs; and now she professes a hot-house, which, I think, is a very ill house too.<br/><br/>How know you that?<br/>",
        "Nought rests for me, in this tumultuous strife<br/>But to make open proclamation.<br/>Come, officer: as loud as e&#x27;er thou canst;<br/>Cry.<br/><br/>All manner of men, assembled here in arms this day, against God&#x27;s peace and the king&#x27;s, we charge and command you, in his highness&#x27; name, to repair to your several dwelling-places; and not to wear, handle, or use, any sword, weapon, or dagger, henceforward, upon pain of death.<br/><br/>Cardinal, I&#x27;ll be no breaker of the law;<br/>But we shall meet and break our minds at large.",
        "And now they never meet in grove, or green,<br/>By fountain clear, or spangled starlight sheen,<br/>But they do square; that all their elves, for fear,<br/>Creep into acorn-cups and hide them there.<br/><br/>Either I mistake your shape and making quite,<br/>Or else you are that shrewd and knavish sprite<br/>Call&#x27;d Robin Goodfellow: are you not he<br/>That frights the maidens of the villagery;<br/>Skim milk, and sometimes labour in the quern,",
        "We have been down together in my sleep,<br/>Unbuckling helms, fisting each other&#x27;s throat,<br/>And wak&#x27;d half dead with nothing. Worthy Marcius,<br/>Had we no quarrel else to Rome, but that<br/>Thou art thence banish&#x27;d, we would muster all<br/>From twelve to seventy, and, pouring war<br/>Into the bowels of ungrateful Rome,<br/>Like a bold flood o&#x27;er-bear. O! come; go in,<br/>And take our friendly senators by the hands,<br/>Who now are here, taking their leaves of me,",
        "She will beshrew me much that Romeo<br/>Hath had no notice of these accidents;<br/>But I will write again to Mantus,<br/>And keep her at my cell till Romeo come:<br/>Poor living corse, clos&#x27;d in a dead man&#x27;s tomb!<br/><br/>Give me thy torch, boy: hence, and stand aloof;<br/>Yet put it out, for I would not be seen.<br/>Under yond yew-trees lay thee all along,<br/>Holding thine ear close to the hollow ground:",
        "And secretly to greet the empress&#x27; friends.<br/>Come on, you thick-lipp&#x27;d slave, I&#x27;ll bear you hence;<br/>For it is you that puts us to our shifts:<br/>I&#x27;ll make you feed on berries and on roots,<br/>And feed on curds and whey, and suck the goat,<br/>And cabin in a cave, and bring you up<br/>To be a warrior, and command a camp.<br/><br/>Come, Marcus, come; kinsmen, this is the way.<br/>Sir boy, now let me see your archery:",
        "Faith, I have heard too much, for your words and performances are no kin together.<br/><br/>You charge me most unjustly.<br/><br/>With nought but truth. I have wasted myself out of my means. The jewels you have had from me to deliver to Desdemona would half have corrupted a votarist; you have told me she has received them, and returned me expectations and comforts of sudden respect and acquaintance, but I find none.<br/><br/>Well; go to; very well.<br/><br/>Very well! go to! I cannot go to, man; nor &#x27;tis not very well: by this hand, I say, it is very scurvy, and begin to find myself fobbed in it.",
        "I do not greatly care to be deceiv&#x27;d,<br/>That have no use for trusting. If your master<br/>Would have a queen his beggar, you must tell him,<br/>That majesty, to keep decorum, must<br/>No less beg than a kingdom; if he please<br/>To give me conquer&#x27;d Egypt for my son,<br/>He gives me so much of mine own as I<br/>Will kneel to him with thanks.<br/><br/>Be of good cheer;",
        "They say the bishop and Northumberland<br/>Are fifty thousand strong.<br/><br/>It cannot be, my lord!<br/>Rumour doth double, like the voice and echo,<br/>The numbers of the fear&#x27;d. Please it your Grace<br/>To go to bed: upon my soul, my lord,<br/>The powers that you already have sent forth<br/>Shall bring this prize in very easily.<br/>To comfort you the more, I have receiv&#x27;d",
        "And nothing I to back my suit withal<br/>But the plain devil and dissembling looks,<br/>And yet to win her, all the world to nothing!<br/>Ha!<br/>Hath she forgot already that brave prince,<br/>Edward, her lord, whom I, some three months since,<br/>Stabb&#x27;d in my angry mood at Tewksbury?<br/>A sweeter and a lovelier gentleman,<br/>Fram&#x27;d in the prodigality of nature,<br/>Young, valiant, wise, and, no doubt, right royal,",
        "I have but little gold of late, brave Timon,<br/>The want whereof doth daily make revolt<br/>In my penurious band: I have heard and griev&#x27;d<br/>How cursed Athens, mindless of thy worth,<br/>Forgetting thy great deeds, when neighbour states,<br/>But for thy sword and fortune, trod upon them,<br/><br/>I prithee, beat thy drum, and get thee gone.<br/><br/>I am thy friend, and pity thee, dear Timon.",
        "Gives token of a goodly day to-morrow.<br/>Sir William Brandon, you shall bear my standard.<br/>Give me some ink and paper in my tent:<br/>I&#x27;ll draw the form and model of our battle,<br/>Limit each leader to his several charge,<br/>And part in just proportion our small power.<br/>My Lord of Oxford, you, Sir William Brandon,<br/>And you, Sir Walter Herbert, stay with me.<br/>The Earl of Pembroke keeps his regiment:<br/>Good Captain Blunt, bear my good-night to him,",
        "O grim-look&#x27;d night! O night with hue so black!<br/>O night, which ever art when day is not!<br/>O night! O night! alack, alack, alack!<br/>I fear my Thisby&#x27;s promise is forgot.<br/>And thou, O wall! O sweet, O lovely wall!<br/>That stand&#x27;st between her father&#x27;s ground and mine;<br/>Thou wall, O wall! O sweet, and lovely wall!<br/>Show me thy chink to blink through with mine eyne.<br/><br/>Thanks, courteous wall: Jove shield thee well for this!",
        "Stir up the Athenian youth to merriments;<br/>Awake the pert and nimble spirit of mirth;<br/>Turn melancholy forth to funerals;<br/>The pale companion is not for our pomp.<br/><br/>Hippolyta, I woo&#x27;d thee with my sword,<br/>And won thy love doing thee injuries;<br/>But I will wed thee in another key,<br/>With pomp, with triumph, and with revelling.<br/>",
        "Farewell, young lords: these war-like principles<br/>Do not throw from you: and you, my lords, farewell:<br/>Share the advice betwixt you; if both gain, all<br/>The gift doth stretch itself as &#x27;tis receiv&#x27;d,<br/>And is enough for both.<br/><br/>&#x27;Tis our hope, sir,<br/>After well enter&#x27;d soldiers, to return<br/>And find your Grace in health.<br/>",
        "Sirrah Costard, I will enfranchise thee.<br/><br/>O! marry me to one Frances: I smell some l&#x27;envoy, some goose, in this.<br/><br/>By my sweet soul, I mean setting thee at liberty, enfreedoming thy person: thou wert immured, restrained, captivated, bound.<br/><br/>True, true, and now you will be my purgation and let me loose.<br/><br/>I give thee thy liberty, set thee from durance; and in lieu thereof, impose upon thee nothing but this:",
        "And won her soul; and she, sweet lady, dotes,<br/>Devoutly dotes, dotes in idolatry,<br/>Upon this spotted and inconstant man.<br/><br/>I must confess that I have heard so much,<br/>And with Demetrius thought to have spoke thereof;<br/>But, being over-full of self-affairs,<br/>My mind did lose it. But, Demetrius, come;<br/>And come, Egeus; you shall go with me,<br/>I have some private schooling for you both.",
        "It were a grief so brief to part with thee:<br/>Farewell.<br/><br/>Things have fall&#x27;n out, sir, so unluckily,<br/>That we have had no time to move our daughter:<br/>Look you, she lov&#x27;d her kinsman Tybalt dearly,<br/>And so did I: well, we were born to die.<br/>&#x27;Tis very late, she&#x27;ll not come down to night:<br/>I promise you, but for your company,<br/>I would have been a-bed an hour ago.",
        "Were all the letters suns, I could not see.<br/><br/>I would not take this from report; it is,<br/>And my heart breaks at it.<br/><br/>Read.<br/><br/>What! with the case of eyes?<br/><br/>O, ho! are you there with me? No eyes in your head, nor no money in your purse? Your eyes are in a heavy case, your purse in a light: yet you see how this world goes.",
        "Either your unparagoned mistress is dead, or she&#x27;s outprized by a trifle.<br/><br/>You are mistaken; the one may be sold, or given; or if there were wealth enough for the purchase, or merit for the gift; the other is not a thing for sale, and only the gift of the gods.<br/><br/>Which the gods have given you?<br/><br/>Which, by their graces, I will keep.<br/><br/>You may wear her in little yours, but, you know, strange fowl light upon neighbouring ponds. Your ring may be stolen, too; so your brace of unprizeable estimations, the one is but frail and the other causal; a cunning thief, or a that way accomplished courtier, would hazard the winning both of first and last.",
        "And forc&#x27;d to drink their vapour.<br/><br/>The gods forbid!<br/><br/>Nay, &#x27;tis most certain, Iras. Saucy lictors<br/>Will catch at us, like strumpets, and scald rimers<br/>Ballad us out o&#x27; tune; the quick comedians<br/>Extemporally will stage us, and present<br/>Our Alexandrian revels. Antony<br/>Shall be brought drunken forth, and I shall see",
        "Thou hest, most ignorant monster: I am in case to justle a constable. Why, thou deboshed fish thou, was there ever a man a coward that hath drunk so much sack as I to-day? Wilt thou tell a monstrous lie, being but half a fish and half a monster?<br/><br/>Lo, how he mocks me! wilt thou let him, my lord?<br/><br/>&#x27;Lord&#x27; quoth he!that a monster should be such a natural!<br/><br/>Lo, lo, again! bite him to death, I prithee.<br/><br/>Trinculo, keep a good tongue in your head: if you prove a mutineer, the next tree! The poor monster&#x27;s my subject, and he shall not suffer indignity.",
        "&#x27;Zounds! ye fat paunch, an ye call me coward, I&#x27;ll stab thee.<br/><br/>I call thee coward! I&#x27;ll see thee damned ere I call thee coward; but I would give a thousand pound I could run as fast as thou canst. You are straight enough in the shoulders; you care not who sees your back: call you that backing of your friends? A plague upon such backing! give me them that will face me. Give me a cup of sack: I am a rogue if I drunk to-day.<br/><br/>O villain! thy lips are scarce wiped since thou drunkest last.<br/><br/>All&#x27;s one for that.",
        "From love&#x27;s weak childish bow she lives unharm&#x27;d.<br/>She will not stay the siege of loving terms,<br/>Nor bide the encounter of assailing eyes,<br/>Nor ope her lap to saint-seducing gold:<br/>O! she is rich in beauty; only poor<br/>That, when she dies, with beauty dies her store.<br/><br/>Then she hath sworn that she will still live chaste?<br/><br/>She hath, and in that sparing makes huge waste;",
        "For blood of ours shed blood of Montague.<br/>O cousin, cousin!<br/><br/>Benvolio, who began this bloody fray?<br/><br/>Tybalt, here slain, whom Romeo&#x27;s hand did slay:<br/>Romeo, that spoke him fair, bade him bethink<br/>How nice the quarrel was, and urg&#x27;d withal<br/>Your high displeasure: all this, uttered<br/>With gentle breath, calm look, knees humbly bow&#x27;d,",
        "And I, my lord.<br/><br/>And you too, gentle Hero?<br/><br/>I will do any modest office, my lord, to help my cousin to a good husband.<br/><br/>And Benedick is not the unhopefullest husband that I know. Thus far can I praise him; he is of a noble strain, of approved valour, and confirmed honesty. I will teach you how to humour your cousin, that she shall fall in love with Benedick; and I, with your two helps, will so practise on Benedick that, in despite of his quick wit and his queasy stomach, he shall fall in love with Beatrice. If we can do this, Cupid is no longer an archer: his glory shall be ours, for we are the only love-gods. Go in with me, and I will tell you my drift.",
        "As who should say, &#x27;Old lad, I am thine own.&#x27;<br/>He is your brother, lords, sensibly fed<br/>Of that self blood that first gave life to you;<br/>And from that womb where you imprison&#x27;d were<br/>He is enfranchised and come to light:<br/>Nay, he is your brother by the surer side,<br/>Although my seal be stamped in his face.<br/><br/>Aaron, what shall I say unto the empress?<br/>",
        "O lord archbishop!<br/>Thou hast made me now a man: never, before<br/>This happy child, did I get any thing.<br/>This oracle of comfort has so pleas&#x27;d me,<br/>That when I am in heaven, I shall desire<br/>To see what this child does, and praise my Maker.<br/>I thank ye all. To you, my good Lord Mayor,<br/>And your good brethren, I am much beholding;<br/>I have receiv&#x27;d much honour by your presence,",
        "And men ne&#x27;er spend their fury on a child.<br/>What&#x27;s worse than murderer, that I may name it?<br/>No, no, my heart will burst, an if I speak:<br/>And I will speak, that so my heart may burst.<br/>Butchers and villains! bloody cannibals!<br/>How sweet a plant have you untimely cropp&#x27;d!<br/>You have no children, butchers! if you had,<br/>The thought of them would have stirr&#x27;d up remorse:<br/>But if you ever chance to have a child,<br/>Look in his youth to have him so cut off",
        "Desire him not to flatter with his lord,<br/>Nor hold him up with hopes: I&#x27;m not for him.<br/>If that the youth will come this way to-morrow,<br/>I&#x27;ll give him reasons for&#x27;t. Hie thee, Malvolio.<br/><br/>Madam, I will.<br/><br/>I do I know not what, and fear to find<br/>Mine eye too great a flatterer for my mind.<br/>Fate, show thy force: ourselves we do not owe;",
        "Who, Hero?<br/><br/>Even she: Leonato&#x27;s Hero, your Hero, every man&#x27;s Hero.<br/><br/>Disloyal?<br/><br/>The word&#x27;s too good to paint out her wickedness; I could say, she were worse: think you of a worse title, and I will fit her to it. Wonder not till further warrant: go but with me to-night, you shall see her chamber-window entered, even the night before her wedding-day: if you love her then, to-morrow wed her; but it would better fit your honour to change your mind.<br/><br/>May this be so?",
        "No worse than I, upon some agreement<br/>Me shall you find ready and willing<br/>With one consent to have her so bestow&#x27;d;<br/>For curious I cannot be with you,<br/>Signior Baptista, of whom I hear so well.<br/><br/>Sir, pardon me in what I have to say:<br/>Your plainness and your shortness please me well.<br/>Right true it is, your son Lucentio here<br/>Doth love my daughter and she loveth him,",
        "Marry, Master schoolmaster, he that is likest to a hogshead.<br/><br/>Piercing a hogshead! a good lustre of conceit in a turf of earth; fire enough for a flint, pearl enough for a swine: &#x27;tis pretty; it is well.<br/><br/>Good Master parson<br/><br/>be so good as read me this letter: it was given me by Costard, and sent me from Don Armado: I beseech you, read it.<br/><br/>Fauste, precor gelida quando pecus omne sub umbra Ruminat, and so forth. Ah! good old Mantuan. I may speak of thee as the traveller doth of Venice:",
        "Go you before, and I will follow you.<br/><br/>He cannot live, I hope; and must not die<br/>Till George be pack&#x27;d with post-horse up to heaven.<br/>I&#x27;ll in, to urge his hatred more to Clarence,<br/>With lies well steel&#x27;d with weighty arguments;<br/>And, if I fail not in my deep intent,<br/>Clarence hath not another day to live:<br/>Which done, God take King Edward to his mercy,",
        "Will this content you, Kate?<br/><br/>It must, of force.<br/><br/>Ned, prithee, come out of that fat room, and lend me thy hand to laugh a little.<br/><br/>Where hast been, Hal?<br/><br/>With three or four loggerheads amongst three or four score hogsheads. I have sounded the very base string of humility. Sirrah, I am sworn brother to a leash of drawers, and can call them all by their christen names, as Tom, Dick, and Francis. They take it already upon their salvation, that though I be but Prince of Wales, yet I am the king of courtesy; and tell me flatly I am no proud Jack, like Falstaff, but a Corinthian, a lad of mettle, a good boy,by the Lord, so they call me,and when I am king of England, I shall command all the good lads in Eastcheap. They call drinking deep, dyeing scarlet; and when you breathe in your watering, they cry &#x27;hem!&#x27; and bid you play it off. To conclude, I am so good a proficient in one quarter of an hour, that I can drink with any tinker in his own language during my life. I tell thee, Ned, thou hast lost much honour that thou wert not with me in this action. But, sweet Ned,to sweeten which name of Ned, I give thee this pennyworth of sugar, clapped even now into my hand by an underskinker, one that never spake other English in his life than &#x27;Eight shillings and sixpence,&#x27; and &#x27;You are welcome,&#x27; with this shrill addition,&#x27;Anon, anon, sir! Score a pint of bastard in the Half-moon,&#x27; or so. But, Ned, to drive away the time till Falstaff come, I prithee do thou stand in some by-room, while I question my puny drawer to what end he gave me the sugar; and do thou never leave calling &#x27;Francis!&#x27; that his tale to me may be nothing but &#x27;Anon.&#x27; Step aside, and I&#x27;ll show thee a precedent.",
        "God save your Grace!<br/><br/>And yours, most noble Bardolph.<br/><br/>Come, you virtuous ass, you bashful fool, must you be blushing? wherefore blush you now? What a maidenly man-at-arms are you become! Is it such a matter to get a pottle-pot&#x27;s maidenhead?<br/><br/>A&#x27; calls me even now, my lord, through a red lattice, and I could discern no part of his face from the window: at last, I spied his eyes, and methought he had made two holes in the ale-wife&#x27;s new petticoat, and peeped through.<br/><br/>Hath not the boy profited?",
        "And still proclaimeth, as he comes along,<br/>His arms are only to remove from thee<br/>The Duke of Somerset, whom he terms a traitor.<br/><br/>Thus stands my state, &#x27;twixt Cade and York distress&#x27;d;<br/>Like to a ship, that, having scap&#x27;d a tempest,<br/>Is straight way calm&#x27;d, and boarded with a pirate.<br/>But now is Cade driven back, his men dispers&#x27;d;<br/>And now is York in arms to second him.<br/>I pray thee, Buckingham, go and meet him,",
        "A golden mesh to entrap the hearts of men<br/>Faster than gnats in cobwebs: but her eyes!<br/>How could he see to do them? having made one,<br/>Methinks it should have power to steal both his<br/>And leave itself unfurnish&#x27;d: yet look, how far<br/>The substance of my praise doth wrong this shadow<br/>In underprizing it, so far this shadow<br/>Doth limp behind the substance. Here&#x27;s the scroll,<br/>The continent and summary of my fortune.<br/>",
        "Being skilless in these parts; which to a stranger,<br/>Unguided and unfriended, often prove<br/>Rough and unhospitable: my willing love,<br/>The rather by these arguments of fear,<br/>Set forth in your pursuit.<br/><br/>My kind Antonio,<br/>I can no other answer make but thanks,<br/>And thanks, and ever thanks; for oft good turns<br/>Are shuffled off with such uncurrent pay:",
        "That long hath frown&#x27;d upon their enmity!<br/>What traitor hears me, and says not amen?<br/>England hath long been mad, and scarr&#x27;d herself;<br/>The brother blindly shed the brother&#x27;s blood,<br/>The father rashly slaughter&#x27;d his own son,<br/>The son, compell&#x27;d, been butcher to the sire:<br/>All this divided York and Lancaster,<br/>Divided in their dire division,<br/>O! now, let Richmond and Elizabeth,<br/>The true succeeders of each royal house,",
        "Yea, signior; and depart when you bid me.<br/><br/>O, stay but till then!<br/><br/>&#x27;Then&#x27; is spoken; fare you well now: and yet, ere I go, let me go with that I came for; which is, with knowing what hath passed between you and Claudio.<br/><br/>Only foul words; and thereupon I will kiss thee.<br/><br/>Foul words is but foul wind, and foul wind is but foul breath, and foul breath is noisome; therefore I will depart unkissed.<br/>",
        "The curse of heaven and men succeed their evils!<br/>Till when the which, I hope, shall ne&#x27;er be seen<br/>Your Grace is welcome to our town and us.<br/><br/>Which welcome we&#x27;ll accept; feast here awhile,<br/>Until our stars that frown lend us a smile.<br/><br/>Here have you seen a mighty king<br/>His child, I wis, to incest bring;<br/>A better prince and benign lord,",
        "An&#x27;t please your majesty, let his neck answer for it, if there is any martial law in the &#x27;orld.<br/><br/>How canst thou make me satisfaction?<br/><br/>All offences, my lord, come from the heart: never came any from mine that might offend your majesty.<br/><br/>It was ourself thou didst abuse.<br/><br/>Your majesty came not like yourself: you appeared to me but as a common man; witness the night, your garments, your lowliness; and what your highness suffered under that shape, I beseech you, take it for your own fault and not mine: for had you been as I took you for I made no offence; therefore, I beseech your highness, pardon me.",
        "Now tell me how long you would have her after you have possessed her?<br/><br/>For ever and a day.<br/><br/>Say &#x27;a day,&#x27; without the &#x27;ever.&#x27; No, no, Orlando; men are April when they woo, December when they wed: maids are May when they are maids, but the sky changes when they are wives. I will be more jealous of thee than a Barbary cock-pigeon over his hen; more clamorous than a parrot against rain; more new-fangled than an ape; more giddy in my desires than a monkey: I will weep for nothing, like Diana in the fountain, and I will do that when you are disposed to be merry; I will laugh like a hyen, and that when thou art inclined to sleep.",
        "With these mortals on the ground.<br/><br/>Go, one of you, find out the forester;<br/>For now our observation is perform&#x27;d;<br/>And since we have the vaward of the day,<br/>My love shall hear the music of my hounds.<br/>Uncouple in the western valley; let them go:<br/>Dispatch, I say, and find the forester.<br/>We will, fair queen, up to the mountain&#x27;s top,<br/>And mark the musical confusion",
        "As we his subjects have in wonder found<br/>Between the promise of his greener days<br/>And these he masters now. Now he weighs time<br/>Even to the utmost grain; that you shall read<br/>In your own losses, if he stay in France.<br/><br/>To-morrow shall you know our mind at full.<br/><br/>Dispatch us with all speed, lest that our king<br/>Come here himself to question our delay;",
        "A deed of slander with thy fatal hand<br/>Upon my head and all this famous land.<br/><br/>From your own mouth, my lord, did I this deed.<br/><br/>They love not poison that do poison need,<br/>Nor do I thee: though I did wish him dead,<br/>I hate the murderer, love him murdered.<br/>The guilt of conscience take thou for thy labour,<br/>But neither my good word nor princely favour:",
        "Shall come apparell&#x27;d in more precious habit,<br/>More moving-delicate, and full of life<br/>Into the eye and prospect of his soul,<br/>Than when she liv&#x27;d indeed: then shall he mourn,<br/>If ever love had interest in his liver,<br/>And wish he had not so accused her,<br/>No, though he thought his accusation true.<br/>Let this be so, and doubt not but success<br/>Will fashion the event in better shape<br/>Than I can lay it down in likelihood.",
        "Let me look back upon thee. O thou wall,<br/>That girdlest in those wolves, dive in the earth.<br/>And fence not Athens! Matrons, turn incontinent!<br/>Obedience fail in children! slaves and fools,<br/>Pluck the grave wrinkled senate from the bench,<br/>And minister in their steads! To general filths<br/>Convert, o&#x27;the instant, green virginity!<br/>Do&#x27;t in your parents&#x27; eyes! Bankrupts, hold fast;<br/>Rather than render back, out with your knives,<br/>And cut your trusters&#x27; throats! Bound servants, steal!",
        "He speaks not like a man of God&#x27;s making,<br/><br/>That&#x27;s all one, my fair, sweet, honey monarch; for, I protest, the schoolmaster is exceeding fantastical; too-too vain; too-too vain: but we will put it, as they say, to fortuna de la guerra. I wish you the peace of mind, most royal couplement!<br/><br/>Here is like to be a good presence of Worthies. He presents Hector of Troy; the swain, Pompey the Great; the parish curate, Alexander; Armado&#x27;s page, Hercules; the pedant, Judas Maccab us:<br/>And if these four Worthies in their first show thrive,",
        "All may be well.<br/><br/>Now might I do it pat, now he is praying;<br/>And now I&#x27;ll do&#x27;t: and so he goes to heaven;<br/>And so am I reveng&#x27;d. That would be scann&#x27;d:<br/>A villain kills my father; and for that,<br/>I, his sole son, do this same villain send<br/>To heaven.<br/>Why, this is hire and salary, not revenge.<br/>He took my father grossly, full of bread,",
        "Where when men been, there&#x27;s seldom ease;<br/>For now the wind begins to blow;<br/>Thunder above and deeps below<br/>Make such unquiet, that the ship<br/>Should house him safe is wrack&#x27;d and split;<br/>And he, good prince, having all lost,<br/>By waves from coast to coast is tost.<br/>All perishen of man, of pelf,<br/>Ne aught escapen but himself;<br/>Till Fortune, tir&#x27;d with doing bad,",
        "Who will believe thee, Isabel?<br/>My unsoil&#x27;d name, the austereness of my life,<br/>My vouch against you, and my place i&#x27; the state,<br/>Will so your accusation overweigh,<br/>That you shall stifle in your own report<br/>And smell of calumny. I have begun;<br/>And now I give my sensual race the rein:<br/>Fit thy consent to my sharp appetite;<br/>Lay by all nicety and prolixious blushes,<br/>That banish what they sue for; redeem thy brother",
        "O! pity, pity; gentle heaven, pity.<br/>The red rose and the white are on his face,<br/>The fatal colours of our striving houses:<br/>The one his purple blood right well resembles;<br/>The other his pale cheeks, methinks, presenteth:<br/>Wither one rose, and let the other flourish!<br/>If you contend, a thousand lives must wither.<br/><br/>How will my mother for a father&#x27;s death<br/>Take on with me and ne&#x27;er be satisfied!",
        "For who is he, whose chin is but enrich&#x27;d<br/>With one appearing hair, that will not follow<br/>Those call&#x27;d and choice-drawn cavaliers to France?<br/>Work, work your thoughts, and therein see a siege;<br/>Behold the ordenance on their carriages,<br/>With fatal mouths gaping on girded Harfleur.<br/>Suppose the ambassador from the French comes back;<br/>Tells Harry that the king doth offer him<br/>Katharine his daughter; and with her, to dowry,<br/>Some petty and unprofitable dukedoms:",
        "Is in the field, and still his power increaseth.<br/><br/>Ely with Richmond troubles me more near<br/>Than Buckingham and his rash-levied strength.<br/>Come; I have learn&#x27;d that fearful commenting<br/>Is leaden servitor to dull delay:<br/>Delay leads impotent and snail-pac&#x27;d beggary:<br/>Then fiery expedition be my wing,<br/>Jove&#x27;s Mercury, and herald for a king!<br/>Go, muster men: my counsel is my shield;",
        "I will hear you, Master Fenton; and I will, at the least, keep your counsel.<br/><br/>From time to time I have acquainted you<br/>With the dear love I bear to fair Anne Page;<br/>Who, mutually hath answer&#x27;d my affection,<br/>So far forth as herself might be her chooser,<br/>Even to my wish. I have a letter from her<br/>Of such contents as you will wonder at;<br/>The mirth whereof so larded with my matter,<br/>That neither singly can be manifested,",
        "Should, without eyes, see pathways to his will.<br/>Where shall we dine? O me! What fray was here?<br/>Yet tell me not, for I have heard it all.<br/>Here&#x27;s much to do with hate, but more with love:<br/>Why then, O brawling love! O loving hate!<br/>O any thing! of nothing first create.<br/>O heavy lightness! serious vanity!<br/>Mis-shapen chaos of well-seeming forms!<br/>Feather of lead, bright smoke, cold fire, sick health!<br/>Still-waking sleep, that is not what it is!",
        "Speak to me; I shall answer for her.<br/>Your will?<br/><br/>Most radiant, exquisite, and unmatchable beauty,I pray you tell me if this be the lady of the house, for I never saw her: I would be loath to cast away my speech; for, besides that it is excellently well penned, I have taken great pains to con it. Good beauties, let me sustain no scorn; I am very comptible, even to the least sinister usage.<br/><br/>Whence came you, sir?<br/><br/>I can say little more than I have studied, and that question&#x27;s out of my part. Good gentle one, give me modest assurance if you be the lady of the house, that I may proceed in my speech."
